(41, 1, 40, 34, '归结起来就是重力的因素。在我们地球上，重力会把我们拉向星球的质量中心，因此在平坦的地表，我们自然站得很直。\n\n然而，在一个假设的立方体世界里，会有6个正方形表面。你会朝向这些区域的中心承受向上或向下的重力。当你向边缘靠近时，感觉就好像你在爬一个陡坡，并且重力会把你拉向立方体的质量中心，由于这个质量中心并不是在你双脚的正下方，所以你很难保持直立状态。', NULL, 2207, '2016-05-30 14:22:02', NULL),
