(793, 4, 323, 701, '导航功能\n三维导航既是GPS的首要功能，也是它的基本功能。飞机、船舶、地面车辆以及步行者都可以利用导航仪进行导航。\n2)车辆跟踪功能\n利用GPS和电子地图可以实时显示出车辆的实际位置，并任意放大、缩小、还原、换图;可以随目标移动，使目标始终保持在屏幕上;还可实现多窗口、多车辆、多屏幕同时跟踪。利用该功能可对重要车辆和货物进行跟踪运输.\n3)提供出行路线规划\n提供出行路线规划是汽车导航系统的一项重要辅助功能，它包括自动线路规划和人工线路设计。自动线路规划是由驾驶者确定起点和目的地，由计算机软件按要求自动凌计最佳行驶路线，包括最快的路线、最简单的路线、通过高速公路路段次数最少的路线等的计算。人工线路设计是由驾驶者根据自己的目的地设计起点、终点和途经点等，自动建立线路库。线路规划完毕后，显示器能够在电子地图上显示设计线路，并同时显示汽车运行路径和运行方法。', 0, 154286, '2016-09-01 11:26:59'),
(794, 4, 323, 701, '卫星测时测距 全球定位 监控 追踪\n', 0, 154269, '2016-09-01 11:27:00'),
(795, 4, 323, 701, '导航功能\n三维导航既是GPS的首要功能，也是它的基本功能。飞机、船舶、地面车辆以及步行者都可以利用导航仪进行导航。\n2)车辆跟踪功能\n利用GPS和电子地图可以实时显示出车辆的实际位置，并任意放大、缩小、还原、换图;可以随目标移动，使目标始终保持在屏幕上;还可实现多窗口、多车辆、多屏幕同时跟踪。利用该功能可对重要车辆和货物进行跟踪运输.\n3)提供出行路线规划\n提供出行路线规划是汽车导航系统的一项重要辅助功能，它包括自动线路规划和人工线路设计。自动线路规划是由驾驶者确定起点和目的地，由计算机软件按要求自动凌计最佳行驶路线，包括最快的路线、最简单的路线、通过高速公路路段次数最少的路线等的计算。人工线路设计是由驾驶者根据自己的目的地设计起点、终点和途经点等，自动建立线路库。线路规划完毕后，显示器能够在电子地图上显示设计线路，并同时显示汽车运行路径和运行方法。', 0, 154286, '2016-09-01 11:27:03'),
