(500, 68, 511, 2, 5, '这节课，学习氛围轻松愉快，让我们培养了我们团结协作，认真仔细的能力，比起传统的教学方式这个更有趣，更具有感染力，让我们在玩中学，学中玩，真正的，体会到学习的快乐和趣味性，老师上课的方式非常的好，让我们自己真正的学到知识。', 33, '2016-09-29 16:51:51'),
(501, 68, 511, 2, 5, '游戏增加了学习的兴趣，在玩中学，学中玩，也锻炼了我们分析问题解决问题的能力，团结协作的意识，认真仔细的做事态度，很喜欢这样的上课方式', 35, '2016-09-29 16:53:25'),
(502, 68, 511, 2, 5, '学中乐乐中学的学习模式使学习效率倍增，课前不懂的知识点在有趣的课堂学习后都能轻松的掌握，同学间的团结协作，互相讲解也增加的课堂的丰富性和趣味性，老师的耐心讲解让我们能又好走快的突破难点和重点。', 34, '2016-09-29 16:54:33'),
