(511, 4, 555, 118396, 5, '       智慧教育、智慧课堂是当前教育信息化研究的一个新的热点问题，是信息技术与教育教学深度融合的产物。智慧教育的核心在于用最新的信息技术变革和改进课堂教学，打造智能、高效的课堂。\n      所以我认为还是挺不错的。', 153702, '2016-10-12 09:55:07'),
