(333, 4, 654, 118393, 2, '电弧焊包括（）？', 'a:4:{i:0;s:15:"手工电弧焊";i:1;s:15:"自动埋弧焊";i:2;s:18:"半自动埋弧焊";i:3;s:15:"气体保护焊";}', 'ABCD', '2016-11-09 11:28:23'),
(334, 4, 654, 118393, 0, '焊缝缺陷分为内部和外部缺陷。', 'a:2:{i:0;s:3:"对";i:1;s:3:"错";}', 'A', '2016-11-09 11:29:46'),
(335, 4, 654, 118393, 2, '焊接应力分为？', 'a:3:{i:0;s:6:"纵向";i:1;s:6:"横向";i:2;s:15:"沿厚度方向";}', 'ABC', '2016-11-09 11:30:33'),
(336, 4, 654, 118393, 0, '焊接应力分产生原因是由于热量分布不均造成的。', 'a:2:{i:0;s:3:"对";i:1;s:3:"错";}', 'A', '2016-11-09 11:31:14'),
(337, 4, 654, 118393, 1, '焊接应力对构件下列哪个性能没有影响？', 'a:4:{i:0;s:12:"静力强度";i:1;s:6:"刚度";i:2;s:12:"低温工作";i:3;s:12:"疲劳强度";}', 'A', '2016-11-09 11:32:14'),
(338, 4, 654, 118393, 0, '减小焊接应力焊接变形的措施分为设计上和工艺上两类。', 'a:2:{i:0;s:3:"对";i:1;s:3:"错";}', 'A', '2016-11-09 11:33:19'),
(339, 4, 654, 118393, 0, '机械固定法虽然可以消除焊接变形，但是会加重焊接应力。', 'a:2:{i:0;s:3:"对";i:1;s:3:"错";}', 'A', '2016-11-09 11:34:32'),
(340, 4, 654, 118393, 1, '根据焊缝质量检验标准，可以把焊缝分为（）级。', 'a:4:{i:0;s:1:"1";i:1;s:1:"2";i:2;s:1:"3";i:3;s:1:"4";}', 'C', '2016-11-09 11:35:34'),
(341, 4, 654, 118393, 0, '三级焊缝只作外观检查。', 'a:2:{i:0;s:3:"对";i:1;s:3:"错";}', 'A', '2016-11-09 11:36:16'),
