(144, 14, 57, 20, ' 听语音\n凭证式国债，是指国家采取不印刷实物券，而用填制国库券收款凭证的方式发行的国债。它是以国债收款凭单的形式来作为债权证明，不可上市流通转让，从购买之日起计息。在持有期内，持券人如遇特殊情况需要握取现金，可以到购买网点提前兑取。提前兑取时，除偿还本金外，利息按实际持有天数及相应的利率档次计算，经办机构按兑付本金的2‰收取手续', 0, 405, '2016-06-07 10:39:17'),
