(200, 4, 87, 190, '营业收入完整性认定，主要是检查收入是否有漏记。因为销售收入发生的时间，会有连续编号的销售发票开出，漏记收入的话，账簿记录所附销售发票的编号肯定也是间断的。如果内部控制有效的话，发票编号就应该是连续的。', 0, 144521, '2016-06-08 18:23:27'),
(201, 4, 87, 150, '应当审计的程序已经完成', 0, 144513, '2016-06-08 18:23:42'),
(202, 4, 87, 190, '两者是不同的概念。发生说明发生过而完整性则是从头到尾的整个过程', 0, 144574, '2016-06-08 18:23:51'),
(203, 4, 87, 190, '对于收入完整性认定相关的重大错报风险，控制测试通常更能有效应对，而对于收入发生认定相关的重大错报风险，实质性程序通常更能有效应对', 0, 144534, '2016-06-08 18:24:25'),
(204, 4, 87, 190, '发生是由发生认定推导的审计目标是确认已记录的交易是真实的。完整性由完整性认定推导的审计目标是确认已发生的交易确实已经记录。发生和完整性两者强调的是相反的关注点。发生目标针对潜在的高估，而完整性目标则针对漏记交易（低估）。', 0, 144585, '2016-06-08 18:24:31'),
(205, 4, 87, 150, '审计报告的日期是', 0, 144537, '2016-06-08 18:24:36'),
(206, 4, 87, 190, '发生:记录的交易或事项已经发生，\n而完整性记录的交易和事项均已记录', 0, 144562, '2016-06-08 18:24:44'),
(207, 4, 87, 150, '由于审计报告日期是明确注册会计师对被审计单位资产负债表日后发生的重大事项进行审计所负责任的最后期限，因此审计报告日期的重要性就在于其关系到判断注册会计师是否承担审计责任和责任大小的截止时点问题', 0, 144512, '2016-06-08 18:24:49'),
