(242, 4, 87, 190, '发生：销售商品、提供劳务时，确定营业收入事项和记录是否发生。完整性：所有交易记录和事项是否记录。', 0, 144591, '2016-06-08 18:34:21'),
(243, 4, 87, 190, '发生认定是指交易事项已发生，完整性是指发生的事项已记录', 0, 144577, '2016-06-08 18:35:21'),
(244, 4, 87, 150, '是', 0, 144531, '2016-06-08 18:36:39'),
(245, 4, 87, 150, '审计报告应当注明报告日期。审计报告日期不应早于注册会计师获取充分、适当的审计证据（包括管理层认可对财务报表的责任且已批准财务报表的证据)，并在此基础上对财务报表形成审计意见的日期。', 0, 144591, '2016-06-08 18:37:38'),
(246, 4, 87, 190, '发生是记录的交易或事项已发生', 0, 144531, '2016-06-08 18:38:02'),
(247, 4, 87, 150, '应当审计的程序已经完成审计报告的日期通常与管理层签署已审计财务报表的日期为同一天，或晚于管理层签署已审计财务报表的日期，应该是于签署日期到公布之前', 0, 144583, '2016-06-08 18:40:02'),
(248, 4, 87, 190, '发生是记录的交易或事项已发生', 0, 144583, '2016-06-08 18:42:37'),
(249, 4, 87, 190, '完整性是指所有记录的交易和事项均已记录', 0, 144583, '2016-06-08 18:43:25'),
(250, 4, 98, 0, '当期营业收入出现差错如何调整？', 118252, 0, '2016-06-09 11:26:54'),
(251, 4, 98, 250, '属于影响损益的应直接计入本期与上期相同的净损益项目，属于不影响损益的应调整本期与前期相同的相关项目。', 0, 144571, '2016-06-09 11:38:58'),
(252, 4, 98, 250, '当营业收入出现错误时首先找出错误之处，然后使用正确的会计分录去调整，多记的用红字冲销，少记的用蓝字调整！', 0, 144572, '2016-06-09 11:46:12'),
