(522, 4, 136, 517, '问题：1.护筒的作用？答：固定钻孔位置，开始钻孔时对钻头起导向作用；保护孔口防止孔口土层坍塌；隔离孔内孔外表层水，并保持钻孔内水位高出施工水位以产生足够的静水压力稳固孔壁。', 0, 142439, '2016-06-15 21:21:44'),
(523, 4, 136, 518, '固定钻孔位置，开始钻孔时对钻头起导向作用；保护孔口防止孔口土层坍塌；隔离孔内孔外表层水，并保持钻孔内水位高出施工水位以产生足够的静水压力稳固孔壁。\n', 0, 142441, '2016-06-15 21:24:14'),
(524, 4, 136, 518, '在孔内产生较大的静水压力，可防止坍孔；泥浆向孔外土层渗漏，在钻进过程中，由于钻头的活动，孔壁表面形成一层胶泥，具有护壁作用；同时将孔内外水流切断，能稳定孔内水位；泥浆比重大，具有挟带钻渣作用，利于钻渣排出；冷却钻头和切土润滑作用，降低钻具磨损和发', 0, 142439, '2016-06-15 21:24:34'),
(525, 4, 136, 519, '护筒平面位置应埋设正确，偏差不宜大于50mm；护筒顶标高筒顶也应高出地面0.2 ～ 0.3m；应高出地下水位和施工最高水位1.5 ～ 2.0m；下埋式及上埋式护筒挖坑不宜太大(一般比护筒直径大1～0.6m)，护筒四周应夯填密实粘土。', 0, 142439, '2016-06-15 21:26:20'),
(526, 4, 136, 520, '比重（1.1-1.3），粘度（20s）,含砂率（3%）', 0, 142439, '2016-06-15 21:28:54'),
