(558, 4, 136, 518, '泥浆的作用有哪些？\n赵小航\n在孔内产生较大的静水压力，可防止坍孔；泥浆向孔外土层渗漏，在钻进过程中，由于钻头的活动，孔壁表面形成一层胶泥，具有护壁作用；同时将孔内外水流切断，能稳定孔内水位；泥浆比重大，具有挟带钻渣作用，利于钻渣排出；冷却钻头和切土润滑作用，降低钻具磨损和发热程度。', 0, 142428, '2016-06-15 21:39:09'),
