(784, 34, 298, 782, '根据机械原理，机构具有确定运动时所必须给定的独立运动参数的数目（亦即为了使机构的位置得以确定，必须给定的独立的广义坐标的数目），称为机构自由度（degree of freedom of mechanism）', 0, 7395, '2016-08-31 09:43:04'),
(785, 34, 298, 782, '譬如一个构件,在空间上完全没有约束,那么它可以在3个正交方向上平动,还可以有三个正交方向的转动,那么就有6个自由度.约束增加,自由度就减少,如果该构件的所有运动都被限制,那自由度就是0（相对惯性坐标系静止的构件）', 0, 7406, '2016-08-31 09:43:53'),
(786, 34, 298, 782, '譬如一个构件,在空间上完全没有约束,那么它可以在3个正交方向上平动,还可以有三个正交方向的转动,那么就有6个自由度.约束增加,自由度就减少,如果该构件的所有运动都被限制,那自由度就是0（相对惯性坐标系静止的构件）', 0, 7406, '2016-08-31 09:43:56'),
(787, 34, 298, 782, '　　通常把传送机构的运动称为传送机构的自由度。人从手指到肩部共有27个自由度。而如将机械手的手臂也制成这样多的自由度，既困难又不必要。从力学的角度分析，物件在空间只有6个自由度。因此为抓取和传送在空间不同位置和方位物件，传送机构也应具有6个自由度。常用的机械手传送机构的自由度还多为少于6个的。一般的专用机械手只有2～4个自由度，而通用机械手则多数为3～6个自由度（这里所说的自由度数目，均不包括手指的抓取动作） 。 　　机械手的每一个自由度是由其操作机的独立驱动关节来实现的。所以在应用中，关节和自由度在表达机械手的运动灵活性方面是意义相通的。又由于关节在实际构造上是由回转或移动的轴来完成的，所以又习惯称之为轴。因此，就有了6自由度、6关节或6轴机械手的命名方法。它们都说明这一机械手的操作有6个独立驱动的关节结构，能在其工作空间中实现抓取物件的任意位置和姿态。', 0, 7395, '2016-08-31 09:47:06'),
