(975, 4, 321, 913, 'GNSS最早用来特指Galileo计划中的卫星定位系统，现用来泛指所有通过卫星进行导航与定位的系统，包括GPS、GLONASS、北斗卫星导航系统、Galileo等，相应的GNSS接受机可以同时接收这些定位系统的所有信号进行定位。\nGPS是GIS数据的重要来源。GIS是用来管理空间数据的。GIS和GPS都是测绘学新技术。', 0, 153765, '2016-09-01 11:38:36'),
