(1455, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西 像他们早餐时间供应中式的早餐 这是很得民心的做法，虽然麦当劳后来也改变了战略，开始符合中国的口味，但是人们往往只记得第一人，后面的就不会被人们看的那么重要。', 0, 149174, '2016-09-08 11:21:43'),
