(1459, 4, 385, 1439, '嗯～你们说的都对', 0, 149265, '2016-09-08 11:22:11'),
(1460, 4, 385, 1439, '两者虽在目标人群的选择上，均为城市家庭，但在构成家庭的三大群体（即孩子、年轻父母、年轻男女）上却有所偏倚：麦当劳在2004年变脸之前，一直坚持以孩子为中心的家庭，然后才是兼顾父母与年轻男女；而肯德基则是以年轻男女为中心，然后兼顾孩子与年轻父母。两者似乎虽仅存毫厘之差，但这毫厘之差却决定了两者的经营重心，影响了两者在餐厅的装修与布局、产品与选址等诸多环节上的细微差别。 \n\n据相关调研数据显示，中国洋快餐的消费，16～25岁的年轻人无论是在消费人群比重还是消费金额比重上，均在60％以上。而占30～40％的儿童与家长市场，消费权则基本由已成人的家长决定。可以说，洋快餐的消费决策者基本为成人，绝非儿童，尤其是在“快餐健康危机”频频的今天。 \n\n产品定位之大同小异 \n\n大家知道，早先肯德基和麦当劳在产品定位上存在很大的差异，麦当劳以汉堡为主打产品，较为适合欧美人（这从美国食品业界研究机构对2002年和2003年全美快餐销售额和餐厅数量的统计可以看到，连续两年排在前三位分别是麦当劳、汉堡王和温迪，而它们都是以汉堡为主打产品的快餐连锁集团）。而肯德基以鸡肉类的产品为主，与麦当劳相比更适合于亚洲人尤其是中国人的口味，因此更容易为中国消费者接受。近年来麦当劳虽也强力推出与肯德基类似的“麦辣鸡”、“鸡腿汉堡”，然而肯德基六十年烹鸡经验无法在短期复制，其“烹鸡专家”的形象更是无从模仿。比口味比感觉的餐饮市场，产品的细微差异就很大程度上使麦当劳处于不利的竞争位置。\n\n在产品的本土化上，肯德基更是不遗余力地满足中国消费者的不同需求。从20世纪90年代中期起，肯德基就决意要为中国人打造一个合乎中国人需求的品牌。 \n\n我们在研究肯德基与麦当劳的过程中还发现了这样一个事实，虽然这两家彼此都视对方为最重要、最直接的竞争对手，但也都在中国市场都取得了不俗的成绩。他们没有陷入同质化进而互打价格战的恶性竞争中去，却各以各的方式提升自己的竞争力，竞争的结果是实现了双赢。这也许更值得中国本土企业思考和借鉴。 \n老实说，从全球范围看，麦当劳与肯德基不属于同一重量级的对手，无论是发展历史还是整体规模与实力，乃至品牌资产，肯德基均落后于麦当劳。但为何中国市场能成为肯德基压倒性对抗麦当劳的“大本营”？ \n\n肯德基在中国的飞跃首先应该归结于决策层对中国市场特殊性的理解和重视，尤其是对跨文化管理的融合之道更是深领其中真谛，选择合适的将才才能避免失误。其次，我们应该归结于肯德基在中国市场所实施的差异化的三大竞争战略（“瞄准高增长市场、先发制人、加速扩张”）、战略性连锁经营的多品牌整合协同和灵活的两种连锁模式（“直营连锁”与“特许连锁”），这种体系的保证为获取竞争优势奠定了基础。 \n\n对于麦当劳，通过其在中国市场的发展曲线分析，我们不难发现麦当劳在中国市场发展战略具有“滞后迟钝”与“游历摇摆”的两大特征，并长期一味坚持“直营连锁”策略（迟至2003年8月方在中国实施“特许连锁”模式，而肯德基则早在1999年就先行一步，且在2003年业已发展了40多家特许加盟店），从麦当劳的全球市场定位来看，中国市场更是成了其支持在其他市场发展的“造血机”的功能，尤其。 \n\n长期组织决策机制上的遥远与迟缓，在对于战略性的关键选址决策上，麦当劳往往偏执于“价格合适”的稳健保守原则，在诸多城市（如上海）的战略性店铺设立上为肯德基抢得先机，也影响了其在中国市场的扩张。 \n肯德基以家庭成员为主要目标消费者。推广的重点是较容易接受外来文化、新鲜事物的 青少年，一切食品、服务和环境都是有针对性地设计的。这是因为青年人比较喜欢西式快餐 轻快的就餐气氛，并希望以此影响其他年龄层家庭成员的光临。另外肯德基也在儿童顾客上 花费大量的精力，店内专门辟有儿童就餐区，作为儿童庆祝生日的区域，布置了迎合儿童喜 好的多彩装饰，节假日还备有玩具作为礼品，一方面希望培养小孩子从小吃快餐的习惯，另 一方面也希望透过小孩子的带动，能吸引整个家庭成员都到店中接受温馨的服务。儿童长大了，肯德基可能会变成他生活中的一部分。 \n\n可以说，正是由于两者对中国市场与全球市场的重视程度不一致，导致了在战略决策几个主要因素的分野，由此决定了两者在中国市场连锁店的扩张速度与发展数量。 \n肯德基一直想要营造的是一种全家一起用餐的欢乐气氛，强调的是这种附加的价值。这 会给人留下一些较深的印象。他们有很多的美好记忆是在肯德基发生的。客人到餐厅里，首 先感到吃的味道。东西不好吃，再便宜都没有用的。服务再好，装修再漂亮，客人也不会喜 欢。肯德基的市场优势为其鸡类食品的独特口味，定位在“世界著名烹鸡专家”，“烹鸡美味 尽在肯德基”，这也是肯德基与麦当劳定位上的最大的差别。其六十年烹鸡经验烹制而出的炸 鸡系列产品，原味鸡、香辣鸡翅、香脆鸡腿汉堡、无骨鸡柳等，外层金黄香脆，内层嫩滑多汁□以其独特鲜香口味广为顾客称许。肯德基在各种广告宣传里也不断强化其“烹鸡专家” 这一卖点。 \n中国人爱吃鸡，鸡鸭鱼肉中鸡是排第一位的，与其他洋快餐相比，鸡肉类的产品也更符 合中国人的口味，更容易被中国人接受。从麦当劳悄悄打破其在全球市场统一的“牛肉汉堡” 的菜单，在中国市场推出与肯德基类似的“麦辣鸡”和“鸡腿汉堡”，更可以看出这一点。 \n\n肯德基并不满足于目前的成功，而是不断以巨大的人力和财力去寻找适合中国人的口味，肯德基的什么产品是他们喜欢的，他们为什么会喜欢肯德基等等。去调整服务，调整食品， 甚至推出新的产品。 \n3.成本价格上之据高起伏 \n\n众所周知，作为快餐，稳定的产品价格一直其经营持续稳健的象征之一。肯德基与麦当劳两者在同类产品的定价上，在很长的时间里是基本持平的。但时至2003年6月，麦当劳开始挥起了价格利器，首先是迫于全球业绩与成本控制的压力，实施全面的逆势涨价；而在距离整体产品涨价8个多月后（既2004年3月），麦当劳将近十种主打产品全部砍到五元之内，最高降幅达50%，造成不少地区一时抢购脱销的窘困，而这一切均是在降低了产品容量乃至品质的基础上实施的。而肯德基却少有如此价格反复，一直坚持走“合适的价格与合格的产品”路线。 \n\n据悉，麦当劳产品的成本控制也一直居高不下。在产品的采购供应上，麦当劳倾向其美国国内企业为中国提供货源，而肯德基则更钟情于在中国本土发展供货商。加上其与必胜客等品牌的供应链协同共享效应，肯德基在产品成本的控制上也是略胜一筹。 \n\n4、 选址策略上之执行高下 \n\n实事求是地说，麦当劳与肯德基在选址策略上，各有各的圣经。无论是其选址的严谨流程与考量标准，均难辨其高下。麦当劳中国华东地区总裁曾这样宣称，“麦当劳连锁店之所以开一家红火一家，究其原因，第一是地点；第二是地点；第三还是地点。”但在实际执行过程中，其高下却可见一斑：肯德基的选址成功率几乎是百分之百，而麦当劳却常有难言之隐的闭店事件（2002年12月1日，麦当劳成都双楠店突然“消失”得无影无踪。这是麦当劳在中国内地关闭的第一家分店。但是据知情人士透露，四川麦当劳共有10家分店，除总店一直赢利，另两个店偶尔赢利外，其余的基本上都处于亏损状态。就在麦当劳成都双楠店关闭的余波尚未完全平息时，2003年5月底，在南国广州又传出了关店的消息）。 \n\n我们在研究肯德基与麦当劳的过程中还发现了这样一个事实，虽然这两家彼此都视对方为最重要、最直接的竞争对手，但也都在中国市场都取得了不俗的成绩。他们没有陷入同质化进而互打价格战的恶性竞争中去，却各以各的方式提升自己的竞争力，竞争的结果是实现了双赢。这也许更值得中国本土企业思考和借鉴。 \n仔细观察一下城市里，到底是KFC和McDonald哪家餐厅的数量更占优势？ \n从营业收入和年扩张速度来看，在中国大陆市场，KFC也是遥遥领先 \n多年来，KFC与麦当劳的战火不断。去年麦当劳采取价格战，肯德基却一直保持着以前的价格，还有苏丹红事件也让麦当劳的形象也大打折扣，我想这不仅仅是意外事件，还有记得去年的时候麦当劳推出了十元套餐，还引来了一场与消费者之间的官司，还有前些天的杨丞林关于麦当劳的事情，又该如何解释呢？ \n楼上说的对，饮食业走进另一个国家的时候，重要的是本土化的饮食文化的发展，我想说的是，KFC做的也确实不错。很多不错的产品不胜枚举，还有它的产品覆盖了多种年龄段人的需求，也有儿童套餐，如果您注意的话，看看你附近的KFC每个月有一些由小朋友的活动，还会给在KFC过生日的小朋友送上一份生日礼物。我想这更好的满足和发展了潜在的顾客', 0, 149170, '2016-09-08 11:22:11'),
(1461, 4, 385, 1439, '肯德基推出的套餐更加适合当前消费人群的口味，并以健康饮食为辅从而吸引更多的消费人群。', 0, 149202, '2016-09-08 11:22:19'),
(1462, 4, 385, 1439, '麦当劳的东西大部分都是辣的，肯德基是针对中国人的口味推出各自各样的产品。而且在产品广告宣传上，麦当劳不如肯德基。', 0, 149200, '2016-09-08 11:22:41'),
(1463, 4, 385, 1439, '中国肯德基不仅是第一个进入大陆的美式快餐连锁，而且在十几年来，还在一直以领先于麦当劳的速度进行扩张', 0, 149138, '2016-09-08 11:22:48'),
(1464, 4, 385, 1439, '1.麦当劳的东西大部分都是辣的，肯德基是针对中国人的口味推出各自各样的产品。而且在产品广告宣传上，麦当劳不如肯德基。\n2.得知市场细分的重要性', 0, 149179, '2016-09-08 11:22:56'),
(1465, 4, 385, 1439, '肯德基和麦当劳的经营方式的不同，造成了两者之间的差距，两者的经营定位也不同，现在的人们主要是以健康饮食为主，所以以儿童为主的麦当劳比以青年为主的肯德基的发展小。', 0, 149199, '2016-09-08 11:23:02'),
(1466, 4, 385, 1439, '1.麦当劳口味以辣为主肯德基更适合中国人口味  2.麦当劳广告宣传不如肯德基', 0, 149178, '2016-09-08 11:23:22'),
(1467, 4, 385, 1439, '答：从经营模式上来看麦当劳一直坚持直营连锁，而肯德基则是直营连锁与特许连锁相结合。', 0, 149129, '2016-09-08 11:23:49'),
(1468, 4, 385, 1439, '肯德基比麦当劳经营的好', 0, 149270, '2016-09-08 11:23:54'),
(1469, 4, 385, 1439, '两者虽在目标人群的选择上，均为城市家庭，但在构成家庭的三大群体（即孩子、年轻父母、年轻男女）上却有所偏倚：麦当劳在2004年变脸之前，一直坚持以孩子为中心的家庭，然后才是兼顾父母与年轻男女；而肯德基则是以年轻男女为中心，然后兼顾孩子与年轻父母。两者似乎虽仅存毫厘之差，但这毫厘之差却决定了两者的经营重心，影响了两者在餐厅的装修与布局、产品与选址等诸多环节上的细微差别。 ', 0, 149240, '2016-09-08 11:23:55'),
(1470, 4, 385, 1439, '麦当劳开发选址能力不如KFC', 0, 149228, '2016-09-08 11:24:00'),
(1471, 4, 385, 1439, '在宣传力度上人们更多接触到的是KFC的宣传，目前来说青年是主要的消费群体KFC的人群定位更符合广大消费群体。。。', 0, 149262, '2016-09-08 11:24:06'),
(1472, 4, 385, 1439, '1.肯德基更符合中国大众人的口味，肯德基的早点供应就是中式早点。\n2.肯德基以年轻人为主体，麦当劳以青少年为主题。\n3.肯德基的价位也比麦当劳更容易让人接受一些，在选址上肯德基也比麦当劳的选址更贴切。', 0, 149135, '2016-09-08 11:24:07'),
(1473, 4, 385, 1439, '在宣传力度上人们更多接触到的是KFC的宣传，目前来说青年是主要的消费群体KFC的人群定位更符合广大消费群体。。。', 0, 149262, '2016-09-08 11:24:19'),
(1474, 4, 385, 1439, '1.肯德基更符合中国大众人的口味，肯德基的早点供应就是中式早点。\n2.肯德基以年轻人为主体，麦当劳以青少年为主题。\n3.肯德基的价位也比麦当劳更容易让人接受一些，在选址上肯德基也比麦当劳的选址更贴切。', 0, 149135, '2016-09-08 11:24:20'),
(1475, 4, 385, 1439, '两者虽在目标人群的选择上，均为城市家庭，但在构成家庭的三大群体（即孩子、年轻父母、年轻男女）上却有所偏倚：麦当劳在2004年变脸之前，一直坚持以孩子为中心的家庭，然后才是兼顾父母与年轻男女；而肯德基则是以年轻男女为中心，然后兼顾孩子与年轻父母。两者似乎虽仅存毫厘之差，但这毫厘之差却决定了两者的经营重心，影响了两者在餐厅的装修与布局、产品与选址等诸多环节上的细微差别。 据相关调研数据显示，中国洋快餐的消费，16～25岁的年轻人无论是在消费人群比重还是消费金额比重上，均在60％以上。而占30～40％的儿童与家长市场，消费权则基本由已成人的家长决定。可以说，洋快餐的消费决策者基本为成人，绝非儿童，尤其是在“快餐健康危机”频频的今天。 产品定位之大同小异 大家知道，早先肯德基和麦当劳在产品定位上存在很大的差异，麦当劳以汉堡为主打产品，较为适合欧美人（这从美国食品业界研究机构对2002年和2003年全美快餐销售额和餐厅数量的统计可以看到，连续两年排在前三位分别是麦当劳、汉堡王和温迪，而它们都是以汉堡为主打产品的快餐连锁集团）。而肯德基以鸡肉类的产品为主，与麦当劳相比更适合于亚洲人尤其是中国人的口味，因此更容易为中国消费者接受。近年来麦当劳虽也强力推出与肯德基类似的“麦辣鸡”、“鸡腿汉堡”，然而肯德基六十年烹鸡经验无法在短期复制，其“烹鸡专家”的形象更是无从模仿。比口味比感觉的餐饮市场，产品的细微差异就很大程度上使麦当劳处于不利的竞争位置。 在产品的本土化上，肯德基更是不遗余力地满足中国消费者的不同需求。从20世纪90年代中期起，肯德基就决意要为中国人打造一个合乎中国人需求的品牌。 我们在研究肯德基与麦当劳的过程中还发现了这样一个事实，虽然这两家彼此都视对方为最重要、最直接的竞争对手，但也都在中国市场都取得了不俗的成绩。他们没有陷入同质化进而互打价格战的恶性竞争中去，却各以各的方式提升自己的竞争力，竞争的结果是实现了双赢。这也许更值得中国本土企业思考和借鉴。 老实说，从全球范围看，麦当劳与肯德基不属于同一重量级的对手，无论是发展历史还是整体规模与实力，乃至品牌资产，肯德基均落后于麦当劳。但为何中国市场能成为肯德基压倒性对抗麦当劳的“大本营”？ 肯德基在中国的飞跃首先应该归结于决策层对中国市场特殊性的理解和重视，尤其是对跨文化管理的融合之道更是深领其中真谛，选择合适的将才才能避免失误。其次，我们应该归结于肯德基在中国市场所实施的差异化的三大竞争战略（“瞄准高增长市场、先发制人、加速扩张”）、战略性连锁经营的多品牌整合协同和灵活的两种连锁模式（“直营连锁”与“特许连锁”），这种体系的保证为获取竞争优势奠定了基础。 对于麦当劳，通过其在中国市场的发展曲线分析，我们不难发现麦当劳在中国市场发展战略具有“滞后迟钝”与“游历摇摆”的两大特征，并长期一味坚持“直营连锁”策略（迟至2003年8月方在中国实施“特许连锁”模式，而肯德基则早在1999年就先行一步，且在2003年业已发展了40多家特许加盟店），从麦当劳的全球市场定位来看，中国市场更是成了其支持在其他市场发展的“造血机”的功能，尤其。 长期组织决策机制上的遥远与迟缓，在对于战略性的关键选址决策上，麦当劳往往偏执于“价格合适”的稳健保守原则，在诸多城市（如上海）的战略性店铺设立上为肯德基抢得先机，也影响了其在中国市场的扩张。 肯德基以家庭成员为主要目标消费者。推广的重点是较容易接受外来文化、新鲜事物的 青少年，一切食品、服务和环境都是有针对性地设计的。这是因为青年人比较喜欢西式快餐 轻快的就餐气氛，并希望以此影响其他年龄层家庭成员的光临。另外肯德基也在儿童顾客上 花费大量的精力，店内专门辟有儿童就餐区，作为儿童庆祝生日的区域，布置了迎合儿童喜 好的多彩装饰，节假日还备有玩具作为礼品，一方面希望培养小孩子从小吃快餐的习惯，另 一方面也希望透过小孩子的带动，能吸引整个家庭成员都到店中接受温馨的服务。儿童长大了，肯德基可能会变成他生活中的一部分。 可以说，正是由于两者对中国市场与全球市场的重视程度不一致，导致了在战略决策几个主要因素的分野，由此决定了两者在中国市场连锁店的扩张速度与发展数量。 肯德基一直想要营造的是一种全家一起用餐的欢乐气氛，强调的是这种附加的价值。这 会给人留下一些较深的印象。他们有很多的美好记忆是在肯德基发生的。客人到餐厅里，首 先感到吃的味道。东西不好吃，再便宜都没有用的。服务再好，装修再漂亮，客人也不会喜 欢。肯德基的市场优势为其鸡类食品的独特口味，定位在“世界著名烹鸡专家”，“烹鸡美味 尽在肯德基”，这也是肯德基与麦当劳定位上的最大的差别。其六十年烹鸡经验烹制而出的炸 鸡系列产品，原味鸡、香辣鸡翅、香脆鸡腿汉堡、无骨鸡柳等，外层金黄香脆，内层嫩滑多汁□以其独特鲜香口味广为顾客称许。肯德基在各种广告宣传里也不断强化其“烹鸡专家” 这一卖点。 中国人爱吃鸡，鸡鸭鱼肉中鸡是排第一位的，与其他洋快餐相比，鸡肉类的产品也更符 合中国人的口味，更容易被中国人接受。从麦当劳悄悄打破其在全球市场统一的“牛肉汉堡” 的菜单，在中国市场推出与肯德基类似的“麦辣鸡”和“鸡腿汉堡”，更可以看出这一点。 肯德基并不满足于目前的成功，而是不断以巨大的人力和财力去寻找适合中国人的口味，肯德基的什么产品是他们喜欢的，他们为什么会喜欢肯德基等等。去调整服务，调整食品， 甚至推出新的产品。 3.成本价格上之据高起伏 众所周知，作为快餐，稳定的产品价格一直其经营持续稳健的象征之一。肯德基与麦当劳两者在同类产品的定价上，在很长的时间里是基本持平的。但时至2003年6月，麦当劳开始挥起了价格利器，首先是迫于全球业绩与成本控制的压力，实施全面的逆势涨价；而在距离整体产品涨价8个多月后（既2004年3月），麦当劳将近十种主打产品全部砍到五元之内，最高降幅达50%，造成不少地区一时抢购脱销的窘困，而这一切均是在降低了产品容量乃至品质的基础上实施的。而肯德基却少有如此价格反复，一直坚持走“合适的价格与合格的产品”路线。 据悉，麦当劳产品的成本控制也一直居高不下。在产品的采购供应上，麦当劳倾向其美国国内企业为中国提供货源，而肯德基则更钟情于在中国本土发展供货商。加上其与必胜客等品牌的供应链协同共享效应，肯德基在产品成本的控制上也是略胜一筹。 4、 选址策略上之执行高下 实事求是地说，麦当劳与肯德基在选址策略上，各有各的圣经。无论是其选址的严谨流程与考量标准，均难辨其高下。麦当劳中国华东地区总裁曾这样宣称，“麦当劳连锁店之所以开一家红火一家，究其原因，第一是地点；第二是地点；第三还是地点。”但在实际执行过程中，其高下却可见一斑：肯德基的选址成功率几乎是百分之百，而麦当劳却常有难言之隐的闭店事件（2002年12月1日，麦当劳成都双楠店突然“消失”得无影无踪。这是麦当劳在中国内地关闭的第一家分店。但是据知情人士透露，四川麦当劳共有10家分店，除总店一直赢利，另两个店偶尔赢利外，其余的基本上都处于亏损状态。就在麦当劳成都双楠店关闭的余波尚未完全平息时，2003年5月底，在南国广州又传出了关店的消息）。 我们在研究肯德基与麦当劳的过程中还发现了这样一个事实，虽然这两家彼此都视对方为最重要、最直接的竞争对手，但也都在中国市场都取得了不俗的成绩。他们没有陷入同质化进而互打价格战的恶性竞争中去，却各以各的方式提升自己的竞争力，竞争的结果是实现了双赢。这也许更值得中国本土企业思考和借鉴。 仔细观察一下城市里，到底是KFC和McDonald哪家餐厅的数量更占优势？ 从营业收入和年扩张速度来看，在中国大陆市场，KFC也是遥遥领先 多年来，KFC与麦当劳的战火不断。去年麦当劳采取价格战，肯德基却一直保持着以前的价格，还有苏丹红事件也让麦当劳的形象也大打折扣，我想这不仅仅是意外事件，还有记得去年的时候麦当劳推出了十元套餐，还引来了一场与消费者之间的官司，还有前些天的杨丞林关于麦当劳的事情，又该如何解释呢？ 楼上说的对，饮食业走进另一个国家的时候，重要的是本土化的饮食文化的发展，我想说的是，KFC做的也确实不错。很多不错的产品不胜枚举，还有它的产品覆盖了多种年龄段人的需求，也有儿童套餐，如果您注意的话，看看你附近的KFC每个月有一些由小朋友的活动，还会给在KFC过生日的小朋友送上一份生日礼物。我想这更好的满足和发展了潜在的顾客', 0, 149250, '2016-09-08 11:24:30'),
(1476, 4, 385, 1439, '肯德基和麦当劳分别代表着两种不同的连锁经营模式，麦当劳：全球化战略—更倾向于战略性的经营调整。 肯德基：本土化战略——入乡随俗。两个产品的试用人群也不一样。', 0, 149156, '2016-09-08 11:24:34'),
(1477, 4, 385, 1439, '肯德基能够适应中国人的饮食习惯做出相应中国人的食物。并且肯德基的领导者能够做出相应的方案来处理。体现了特许经营管理的好处', 0, 149264, '2016-09-08 11:24:37'),
(1478, 4, 385, 1439, '麦当劳在中国的数量还不及肯德基的零头，肯德基优先进入中国市场并迅速发展', 0, 149141, '2016-09-08 11:24:42'),
(1479, 4, 385, 1439, '第一 肯德基首先是在北京开设连锁店，位于首都，而麦当劳是在深圳，没有北京特别有利的地理位置 第二 肯德基是直营连锁，可以更好的提升品牌影响力，麦当劳是特许连锁，服务的范围地域性 明显，范围有限  第三 现在健康饮食，绿色发展是流行风尚，肯德基比较注重健康发展 ', 0, 149130, '2016-09-08 11:24:43'),
(1480, 4, 385, 1439, '麦当劳的食物口味不符合中国大众口味，肯德基比较注重健康饮食。肯德基的加盟模式优化与麦当劳。', 0, 149180, '2016-09-08 11:24:49'),
(1481, 4, 385, 1439, '1，麦当劳产品设计不如KFC适合中国人；2，麦当劳开发选址能力不如KFC.深层一点说：麦当劳基本用美国文化管理中国公司，KFC把两种文化结合的很好', 0, 149176, '2016-09-08 11:24:56'),
(1482, 4, 385, 1439, '产品定位方向不同，肯德基在中国会根据不同的人制定适合的口味，而麦当劳在中国市场并没有向肯德基一样面向大众口味，并一味坚持了向国外市场一样的直营连锁形式', 0, 149223, '2016-09-08 11:25:04'),
(1483, 4, 385, 1439, '麦当劳与肯德基所面对的人群不同，麦当劳不如肯德基先进入中国市场', 0, 149139, '2016-09-08 11:25:06'),
(1484, 4, 385, 1439, '1.麦当劳的东西大部分都是辣的，肯德基是针对中国人的口味推出各自各样的产品。而且在产品广告宣传上，麦当劳不如肯德基。\n2.得知市场细分的重要性', 0, 149162, '2016-09-08 11:25:09'),
(1485, 4, 385, 1439, '麦当劳的产品设计没有KFC更适合中国人！所以麦当劳没有KFC的发展好。', 0, 149232, '2016-09-08 11:25:22'),
(1486, 4, 385, 1439, '1、麦当劳与肯德基消费人群不同，麦当劳以儿童为主要消费人群，肯德基消费人群更广。2从健康角度来讲，现代人更讲究养生，健康饮食', 0, 149171, '2016-09-08 11:25:22'),
(1487, 4, 385, 1439, '.成本价格上之据高起伏 众所周知，作为快餐，稳定的产品价格一直其经营持续稳健的象征之一。肯德基与麦当劳两者在同类产品的定价上，在很长的时间里是基本持平的。但时至2003年6月，麦当劳开始挥起了价格利器，首先是迫于全球业绩与成本控制的压力', 0, 149215, '2016-09-08 11:25:27'),
(1488, 4, 385, 1439, '肯德基发展是以加盟的方式，下属部门较为容易发展，要求不是很高。而麦当劳是直营的方式，设立的下属门面，较为繁琐。', 0, 149194, '2016-09-08 11:25:28'),
(1489, 4, 385, 1439, '以特许连锁为主～而且肯德基在中国的品牌效应大于麦当劳！麦当劳的服务对象不如肯德基的服务市场大，国人更倾向于肯德基！', 0, 149186, '2016-09-08 11:25:29'),
(1490, 4, 385, 1439, '1.麦当劳的东西大部分都是辣的，肯德基是针对中国人的口味推出各自各样的产品。2.在广告宣传上麦当劳不如肯德基。', 0, 149219, '2016-09-08 11:25:35'),
(1491, 4, 385, 1439, '肯德基比麦当劳经营的好', 0, 149270, '2016-09-08 11:25:37'),
(1492, 4, 385, 1439, '只有第一才会被人记得，这就是市场竞争的现状。在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。', 0, 149134, '2016-09-08 11:25:51'),
(1493, 4, 385, 1439, '麦当劳是直营，企业总部和分部分工明确，但是直营模式融资困难，机构庞大发展较缓慢，麦当劳定位在儿童没有自主购买权。\n肯德基是连锁联盟模式，利于扩张，且定位在青年，能够自主选择购买', 0, 149193, '2016-09-08 11:25:53'),
(1494, 4, 385, 1439, '广告宣传力度不同，针对的消费人群，肯德基更以青年人为主', 0, 149221, '2016-09-08 11:25:54'),
(1495, 4, 385, 1439, '麦当劳无论是在进去中国市场还是加入中国特许连锁模式都略显迟钝，以至于把商机白白输给了肯德基', 0, 149241, '2016-09-08 11:26:00'),
(1496, 4, 385, 1439, '只有第一才会被人记得，这就是市场竞争的现状。在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。', 0, 149134, '2016-09-08 11:26:05'),
(1497, 4, 385, 1439, '因为他们针对的消费人群不同，而肯德基更能关注大众口味，引起广大人群的食欲。', 0, 149218, '2016-09-08 11:26:10'),
(1498, 4, 385, 1439, '原因:1.企业的管理模式不同；\n         2.这两个企业所针对的服务对象不同，麦当劳消费以儿童为主，肯德基以青年人为主；\n       3·品牌效应，肯德基注重品牌设计，通过细节设计让消费者对肯德基这个品牌印象深刻。', 0, 149209, '2016-09-08 11:26:17'),
(1499, 4, 385, 1439, '相比之下肯德基更加适合国人口味，比麦当劳适合加盟', 0, 149161, '2016-09-08 11:26:25');
INSERT INTO `discussion` (`id`, `schoolid`, `classid`, `fid`, `content`, `creatid`, `replyid`, `addtime`) VALUES
(1500, 4, 385, 1439, '肯德基具有中国特色，麦当劳在管理和经营策略上的部分缺失，本地化长期滞后，直接影响了其他中国市场的快速发展。', 0, 149268, '2016-09-08 11:26:30'),
(1501, 4, 385, 1439, '麦当劳在2004年之前，一直坚持以孩子为中心的家庭，然后才是兼顾父母与年轻男女；而肯德基则是以年轻男女为中心，然后兼顾孩子与年轻父母。', 0, 149155, '2016-09-08 11:26:38'),
(1502, 4, 385, 1439, '成本价格上之据高起伏 众所周知，作为快餐，稳定的产品价格一直其经营持续稳健的象征之一。肯德基与麦当劳两者在同类产品的定价上，在很长的时间里是基本持平的。但时至2003年6月，麦当劳开始挥起了价格利器，首先是迫于全球业绩与成本控制的压力', 0, 149148, '2016-09-08 11:26:38'),
(1503, 4, 385, 1439, '麦当劳产品设计不符合中国人的口味，没有肯德基的设计更加复合。所以就肯德基发展比较好。', 0, 149143, '2016-09-08 11:26:41'),
(1504, 4, 385, 1439, '肯德基中国区被马云收购 麦当劳是美国的企业 国人比较爱国 更多去肯德基消费', 0, 149258, '2016-09-08 11:26:54'),
(1505, 4, 385, 1439, '肯德基有家庭式的温馨氛围', 0, 149183, '2016-09-08 11:27:10'),
(1506, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西 像他们早餐时间供应中式的早餐 这是很得民心的做法', 0, 149201, '2016-09-08 11:27:12'),
(1507, 4, 385, 1439, '麦当劳的东西没有几种口味，而肯德基的口味有很多，都符合人们的胃口。', 0, 149137, '2016-09-08 11:27:17'),
(1508, 4, 385, 1439, '我不吃麦当劳，也不吃肯德基，我只吃中国饭，所以麦当劳干不过肯德基', 0, 149237, '2016-09-08 11:27:18'),
(1509, 4, 385, 1439, '只有第一才会被人记得，这就是市场竞争的现状。在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。 　　最先进入中国市场考察的西式快餐是麦当劳，但其一番调查的结果显示：中国人是饮食口味最顽固的国家，不同的地区早餐都会有天壤之别：北京人早上要喝豆酱、吃油条；上海人早上要吃泡饭；广东人要喝早茶；各个地方口味都不同，他们绝对不会吃那些什么汉堡包；洋快餐在这里被斥为“垃圾食品”，麦当劳带着遗憾离开了中国。 　　不久肯德基也派了一个首席代表到中国考察，他是一个有台湾背景的华人，考察完之后他跟老板拍了一个电报说“这里有全世界最大的快餐市场”。当时他看到了北京每天几十万流动人口的市场空隙，“我要在这里，我脚下建全世界最大的肯德基店”。 　　1987年肯德基的第一家店在前门开张了。并且他是全球最大的一家肯德基店，从此肯德基一路狂奔。 　　就这样，肯德基在中国短短三年间，一个巨大的深不见底的市场被撬开；肯德基是中国人了解西式快餐的第一品牌，现而今其已经理直气壮的蹬上了中国西式快餐第一把交椅。 　　如今麦当劳在华拥有餐厅数量还不及肯德基的零头；要知道肯德基在美国本土仅排名第七，而麦当劳可是尽领风骚的第一；但在中国肯德基不仅是第一个进入大陆的美式快餐连锁，而且在十几年来，还在一直以领先于麦当劳的速度进行扩张，麦当劳目前已经在以年增长率在10%以上的速度追赶了，但麦当劳有没有可能赶上肯德基呢？就像一场龟兔赛跑，除非兔子睡觉，你在开店别人也在开店；你永远赶不上他，除非别人睡觉；那肯德基会不会睡觉呢？从目前来看肯德基也并没有放慢脚步并且发展的速度更快，其正以每年新增100家门店的速度不断扩张。', 0, 149203, '2016-09-08 11:27:26'),
(1510, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西 像他们早餐时间供应中式的早餐 这是很得民心的做法', 0, 149230, '2016-09-08 11:27:27'),
(1511, 4, 385, 1439, 'KFC口味重，符合中国人的口味，偏向于有经济能力的成年人，虽不健康，但是往往为了挑战味蕾就拼了。麦当劳的食品是给儿童，快餐不健康，儿童虽然喜欢，但是没有经济能力支付，慢慢的麦当劳就不如KFC了', 0, 149212, '2016-09-08 11:27:28'),
(1512, 4, 385, 1439, '肯德基在目标人群的选择上是青年男女，麦当劳以孩子为主要消费者  显然青年人消费能力高，孩子的消费水平总是受限的', 0, 149220, '2016-09-08 11:27:28'),
(1513, 4, 385, 1439, '因为麦当劳店面分布的广泛性不如肯德基', 0, 149136, '2016-09-08 11:27:30'),
(1514, 4, 385, 1439, '肯德基对中国人饮食做过调查后发现，鸡肉在中国是仅次于猪肉的肉 类，非常有市场。 针对中国人的口味推出香辣鸡翅汉堡可乐薯条等产品。 走本土化策略，对早晚餐加以改良，推出适合中国人口味的稀饭蛋花 汤蔬菜沙拉等产品。 不断对产品进行创新型改良，不断推出新产品。', 0, 149150, '2016-09-08 11:27:31'),
(1515, 4, 385, 1439, '肯德基比麦当劳更加了解中国市场，做出更符合中国消费人群的食物。', 0, 149151, '2016-09-08 11:27:34'),
(1516, 4, 385, 1439, '肯德基更加注重消费者的需求', 0, 149144, '2016-09-08 11:27:34'),
(1517, 4, 385, 1439, '肯德基对中国人饮食做过调查后发现，鸡肉在中国是仅次于猪肉的肉 类，非常有市场。 针对中国人的口味推出香辣鸡翅汉堡可乐薯条等产品。 走本土化策略，对早晚餐加以改良，推出适合中国人口味的稀饭蛋花 汤蔬菜沙拉等产品。 不断对产品进行创新型改良，不断推出新产品。', 0, 149150, '2016-09-08 11:27:51'),
(1518, 4, 385, 1439, '1.肯德基的地理位置比麦当劳好2.肯德基比较符合广大中国人民的口味3.肯德基的直营连锁模式比麦当劳的特许连锁经营模式好', 0, 149140, '2016-09-08 11:28:06'),
(1519, 4, 385, 1439, '中国人先入为主的观念，其次麦当劳更加倾向于西式而肯德基愈来愈中国化。因为肯德基懂得根据中国人的喜好，做出更适合中国大众吃的东西，像他们早餐时间供应中式的早餐，这是很得民心的做法。', 0, 149227, '2016-09-08 11:28:07'),
(1520, 4, 385, 1439, '广告宣传力度不同，肯德基宣传力度更大，针对人群也不同，肯德基宣传力度大，更针对于青少年。', 0, 149244, '2016-09-08 11:28:12'),
(1521, 4, 385, 1439, '肯德基的套餐更适合于青少年群体 ，而麦当劳的套餐数量明显要少于肯德基。同样的营业时间，消费群体的不同 ，间接的决定了营业效益的不同。', 0, 149255, '2016-09-08 11:28:21'),
(1522, 4, 385, 1439, '总部策略也很重要！', 0, 149192, '2016-09-08 11:28:22'),
(1523, 4, 385, 1439, '麦当劳的主营产品是汉堡这种洋餐不符合中国人们的饮食习惯而肯德基以鸡肉为主是符合大部分中国人的口味', 0, 149160, '2016-09-08 11:28:24'),
(1524, 4, 385, 1439, '肯德基对中国人饮食做过调查后发现，鸡肉在中国是仅次于猪肉的肉 类，非常有市场。 针对中国人的口味推出香辣鸡翅汉堡可乐薯条等产品。 走本土化策略，对早晚餐加以改良，推出适合中国人口味的稀饭蛋花 汤蔬菜沙拉等产品。 不断对产品进行创新型改良，不断推出新产品。', 0, 149150, '2016-09-08 11:28:27'),
(1525, 4, 385, 1439, '先后顺序问题，大家都只会记得第一位，如最高的山峰，第一位登上月球的人，而第二位却没人记得，肯德基快上一步，抢的先机，从一开始便给人好印象，所以步步领先', 0, 149182, '2016-09-08 11:28:45'),
(1526, 4, 385, 1439, '肯德基的品牌效应，宣传到位。', 0, 149195, '2016-09-08 11:28:50'),
(1527, 4, 385, 1439, '麦当劳以特许连锁为主，肯德基以加盟方式为主，肯德基的市场服务范围更广。', 0, 149226, '2016-09-08 11:28:51'),
(1528, 4, 385, 1439, '答:肯德基在中国的飞跃首先应该归结于决策层对中国市场特殊性的理解和重视，尤其是对跨文化管理的融合之道更是深领其中真谛。而肯德基六十年烹鸡经验无法在短期复制，其“烹鸡专家”的形象更是无从模仿。比口味比感觉的餐饮市场，产品的细微差异就很大程度上使麦当劳处于不利的竞争位置。', 0, 149213, '2016-09-08 11:28:59'),
(1529, 4, 385, 1439, '这一次是刷存在感', 0, 149142, '2016-09-08 11:29:00'),
(1530, 4, 385, 1439, '肯德基对中国人饮食做过调查后发现，鸡肉在中国是仅次于猪肉的肉 类，非常有市场。 针对中国人的口味推出香辣鸡翅汉堡可乐薯条等产品。 走本土化策略，对早晚餐加以改良，推出适合中国人口味的稀饭蛋花 汤蔬菜沙拉等产品。 不断对产品进行创新型改良，不断推出新产品。', 0, 149150, '2016-09-08 11:29:01'),
(1531, 4, 385, 1439, '肯德基能够抓住时机，迅速站稳市场，以优秀的管理方式经营。', 0, 149218, '2016-09-08 11:29:08'),
(1532, 4, 385, 1439, '品牌效应，当肯德基在中国事先以优势压倒麦当劳以后，人们会更偏向肯德基。', 0, 149169, '2016-09-08 11:29:23'),
(1533, 4, 385, 1439, '简单来说，品牌效应和企业带给顾客的形象', 0, 149203, '2016-09-08 11:29:40'),
(1534, 4, 385, 1439, '说的都很好，存在感很薄弱', 0, 149199, '2016-09-08 11:29:50'),
(1535, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西 像他们早餐时间供应中式的早餐 这是很得民心的做法', 0, 149159, '2016-09-08 11:29:55'),
(1536, 4, 385, 1439, '在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。肯德基的口味更符合中国人的口味。 ', 0, 149261, '2016-09-08 11:29:56'),
(1537, 4, 385, 1439, '1，麦当劳产品设计不如KFC适合中国人；2，麦当劳开发选址能力不如KFC.深层一点说：麦当劳基本用美国文化管理中国公司，KFC把两种文化结合的很好。', 0, 149158, '2016-09-08 11:30:17'),
(1538, 4, 385, 1439, '起步晚，市场占有率不及肯德基', 0, 149133, '2016-09-08 11:30:28'),
(1539, 4, 385, 1439, '1.肯德基服务做的比麦当劳好\n2.针对的消费人群不同\n3.企业经营理念不同，广告效应不同', 0, 149240, '2016-09-08 11:30:30'),
(1540, 4, 385, 1439, '据相关调研数据显示，中国洋快餐的消费，16～25岁的年轻人无论是在消费人群比重还是消费金额比重上，均在60％以上。而占30～40％的儿童与家长市场，消费权则基本由已成人的家长决定。可以说，洋快餐的消费决策者基本为成人，绝非儿童，尤其是在“快餐健康危机”频频的今天。 ', 0, 149175, '2016-09-08 11:30:34'),
(1541, 4, 385, 1439, '肯德基的套餐更适合于青少年群体 ，而麦当劳的套餐数量明显要少于肯德基。同样的营业时间，消费群体的不同 ，间接的决定了营业效益的不同。', 0, 149256, '2016-09-08 11:30:39'),
(1542, 4, 385, 1439, '特许连锁经营与直营连锁的发展区别。麦当劳与中国人的饮食习惯不同，而肯德基则基本满足。', 0, 149142, '2016-09-08 11:30:41'),
(1543, 4, 385, 1439, '主要面向的消费人群不同，麦当劳坚持以孩子为中心的家庭，而肯德基则是以年轻男女为中心。这决定了两者的经营重心，影响了两者的发展。经营模式不同，肯德基以特许经营为主，门店发展较快；麦当劳以直营经营为主，发展较慢。', 0, 149131, '2016-09-08 11:30:47'),
(1544, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西 像他们早餐时间供应中式的早餐 这是很得民心的做法', 0, 149159, '2016-09-08 11:30:49'),
(1545, 4, 385, 1439, '因为肯德基懂得根据中国人的喜好 做出更适合中国大众吃的东西', 0, 149135, '2016-09-08 11:30:51'),
(1546, 4, 385, 1439, '肯德基发展重心在中国，麦当劳错过时机', 0, 149163, '2016-09-08 11:30:54'),
(1547, 4, 385, 1439, '肯德基推出的产品更加适合青少年，麦当劳推出的产品更适合老人和小孩，两者的消费群体不同', 0, 149251, '2016-09-08 11:31:14'),
(1548, 4, 385, 1439, '重要的原因在于影响力和产品的适用人群及国家的饮食习惯', 0, 149273, '2016-09-08 11:31:15'),
(1549, 4, 385, 1439, '肯德基的食品比较适合中国人，更能被中国人所接受，所以肯德基在中国发展的会更好。也因此麦当劳的发展比较落后于肯德基，肯德基影响力也会越来越大', 0, 149177, '2016-09-08 11:31:29'),
(1550, 4, 385, 1439, '麦当劳针对的对象主要是儿童，而肯德基的消费对象主要就是青年人，青年人的消费量远比儿童的消费量大。', 0, 149231, '2016-09-08 11:31:39'),
(1551, 4, 385, 1439, '运营方式的不同', 0, 149203, '2016-09-08 11:31:48'),
(1552, 4, 385, 1439, ' 麦当劳的产品适合各类人群，儿童和上班族为最多，肯德基更符合中国大众人的口味。肯德基的价位也比麦当劳更容易让人接受一些。', 0, 149239, '2016-09-08 11:31:53'),
(1553, 4, 385, 1439, '麦当劳产品设计不如肯德基适合中国人；\n麦当劳开发选址能力不如肯德基\n深层一点说：\n麦当劳基本用美国文化管理中国公司，肯德基把两种文化结合的很好。', 0, 149245, '2016-09-08 11:32:19'),
(1554, 4, 385, 1439, '刷存在', 0, 149240, '2016-09-08 11:32:49'),
(1555, 4, 385, 1439, '肯德基以鸡肉类的产品为主，与麦当劳相比更适合于亚洲人尤其是中国人的口味，因此更容易为中国消费者接受。', 0, 149175, '2016-09-08 11:32:59'),
(1556, 4, 385, 1439, '个人来说更喜欢KFC的宣传方式和广告模式，KFC的宣传更能吸引顾客', 0, 149262, '2016-09-08 11:33:10'),
(1557, 4, 385, 1439, '我想说的你们都说完了', 0, 149247, '2016-09-08 11:33:23'),
(1558, 4, 385, 1439, '长期组织决策机制上的遥远与迟缓，在对于战略性的关键选址决策上，麦当劳往往偏执于“价格合适”的稳健保守原则，在诸多城市（如上海）的战略性店铺设立上为肯德基抢得先机，也影响了其在中国市场的扩张。', 0, 149274, '2016-09-08 11:33:38'),
(1559, 4, 385, 1439, '只有第一才会被人记得，这就是市场竞争的现状。在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。', 0, 149132, '2016-09-08 11:33:49'),
(1560, 4, 385, 1439, '因为随着时代的发展，上班族越来越多，特别是北上广一些城市，上班族经过一天的辛苦工作，懒得做饭，或者说不会做饭，然而快餐便宜，而又喜欢口味重的东西，所以KFC略胜一筹', 0, 149212, '2016-09-08 11:33:56'),
(1561, 4, 385, 1439, '主要是中国人的思想一般是先入为主，所以肯德基比麦当劳热销', 0, 149205, '2016-09-08 11:33:59'),
(1562, 4, 385, 1439, '最先进入中国市场考察的西式快餐是麦当劳，但其一番调查的结果显示：中国人是饮食口味最顽固的国家，不同的地区早餐都会有天壤之别：北京人早上要喝豆酱、吃油条；上海人早上要吃泡饭；广东人要喝早茶；各个地方口味都不同，他们绝对不会吃那些什么汉堡包；洋快餐在这里被斥为“垃圾食品”，麦当劳带着遗憾离开了中国。', 0, 149188, '2016-09-08 11:34:05'),
(1563, 4, 385, 1439, '青年的消费能力明显高于儿童，而且青年人占社会总人口的比重比儿童大', 0, 149166, '2016-09-08 11:34:18'),
(1564, 4, 385, 1439, '原因:1.这两家企业管理模式不同；\n         2.针对的消费对象不同，麦当劳主要针对儿童，肯德基针对青年者；\n        3.品牌效应，肯德基注重品牌设计，通过品牌细节设计让消费者对这个品牌留下深刻印象；', 0, 149209, '2016-09-08 11:34:24'),
(1565, 4, 385, 1439, '中国人是饮食口味和西方不一样，北京人早上要喝豆酱、吃油条；上海人早上要吃泡饭；广东人要喝早茶；各个地方口味都不同，他们不会吃那些什么汉堡包；洋快餐在这里被斥为“垃圾食品”，所以麦当劳退出了中国市场，而肯德基属于快餐，符合中国人的口味，还抓住了时机。', 0, 149146, '2016-09-08 11:34:38'),
(1566, 4, 385, 1439, '麦当劳以孩子为主，然后再是年轻，父母，，肯德基以年轻人为主，，麦当劳以汉堡为主，比较适合欧美，而肯德基以鸡肉为主，比较适合中国人', 0, 149189, '2016-09-08 11:34:41'),
(1567, 4, 385, 1439, '麦当劳一成不变不太符合中国的饮食标准，肯德基会根据市场改变营销策略与方式。', 0, 149198, '2016-09-08 11:34:56'),
(1568, 4, 385, 1439, '肯德基更适合中国人饮食喜欢，而且肯德基的选址也比麦当劳选的准确！', 0, 149271, '2016-09-08 11:36:48'),
(1569, 4, 385, 1439, '只有第一才会被人记得，这就是市场竞争的现状。在市场发展初期，企业应该不惜一切代价占领市场的领导地位。肯德基和麦当劳在中国的不同境遇就说明了这一点。', 0, 149259, '2016-09-08 11:37:14'),
(1570, 4, 385, 1439, '经营理念不同让双方的经营方式也不同，针对的消费者也不相同', 0, 149269, '2016-09-08 11:37:24'),
(1571, 4, 385, 1439, '两者在选择目标消费人群上不同，麦当劳偏向儿童然后兼顾年轻群体，而肯德基偏向年轻群体然后才是儿童。消费人群是关键。还有就是肯德基推出的产品更符合中国人的口味，不断推出新产品。', 0, 149249, '2016-09-08 11:38:44'),
(1572, 4, 385, 1439, '别 抢我词啊', 0, 149198, '2016-09-08 11:39:14'),
(1573, 4, 385, 1439, '肯德基懂得根据中国人的喜好做出更适合中国大众吃的东西', 0, 149211, '2016-09-08 11:42:56'),
(1574, 4, 385, 1439, '经营的方式不同\n', 0, 149132, '2016-09-08 11:43:02'),
(1575, 4, 385, 1439, '因为肯德基能为中国做出改变。', 0, 149132, '2016-09-08 11:44:27'),
(1576, 34, 180, 0, '你想到的逻辑关系有哪些？', 6350, 0, '2016-09-08 15:45:53'),
(1577, 34, 180, 0, '使用逻辑电路的目的', 6350, 0, '2016-09-08 15:59:05'),
(1578, 4, 390, 0, '范围法与质地法的区别与联系', 118377, 0, '2016-09-08 16:35:33'),
(1579, 4, 390, 1578, '两种方法都是在图斑范围内用颜色、网纹、符号等手段显示其质量特征\n它们的差别是：\n质底法表示是布满全区的面状分布现象，分类以布满全区的现象为对象，图面不可能有空白，图斑也不可能有交叉和重叠\n范围法表示是各自独立的间断成片现象，无这些现象的地方出现空白，现象有重叠分布的，图斑也就会产生重叠和交叉', 0, 142524, '2016-09-08 16:39:24'),
(1580, 4, 390, 1578, '这两种方法都是在图斑范围内用颜色、网纹、符号等手段显示其质量特征\n它们的差别是：\n质底法表示是布满全区的面状分布现象，分类以布满全区的现象为对象，图面不可能有空白，图斑也不可能有交叉和重叠\n范围法表示是各自独立的间断成片现象，无这些现象的地方出现空白，现象有重叠分布的，图斑也就会产生重叠和交叉', 0, 142528, '2016-09-08 16:39:37'),
(1581, 4, 390, 1578, '相同点:这两种方法都是在图斑范围内用颜色、网纹、符号等手段显示其质量特征\n它们的差别是：\n质底法表示是布满全区的面状分布现象,分类以布满全区的现象为对象,图面不可能有空白,图斑也不可能有交叉和重叠\n范围法表示是各自独立的间断成片现象,无这些现象的地方出现空白,现象有重叠分布的,图斑也就会产生重叠和交叉', 0, 142609, '2016-09-08 16:39:48'),
(1582, 4, 390, 1578, '范围法表示呈间断成片分布的面状现象\n质底法表示连续分布，布满于整个区域的面状现象\n范围法只表示现象的质量特征，不表示数量特征，现象的不同时期分布的范围相重叠，可以显示现象的发展', 0, 142591, '2016-09-08 16:40:21'),
