(1589, 4, 390, 1578, '相同点：\n①表示呈面状分布的制图对象\n②反映制图对象的质量特征，不反映数量特征\n③表示方法相同\n不同点：\n①质地法反映的是呈连续分布的面状现象，而范围法反映的是呈间断的、呈片状分布的面状现象；\n②质地法图面表示没有空白、不可重叠、交叉，而范围法可以有空白、可重叠、交叉。', 0, 142607, '2016-09-08 16:40:43'),
