(1604, 4, 390, 1578, '两种方法都是在图斑范围内用颜色、网纹、符号等手段显示其质量特征 它们的差别是： 质底法表示是布满全区的面状分布现象，分类以布满全区的现象为对象，图面不可能有空白，图斑也不可能有交叉和重叠 范围法表示是各自独立的间断成片现象，无这些现象的地方出现空白，现象有重叠分布的，图斑也就会产生重叠和交叉。', 0, 142596, '2016-09-08 16:53:33'),
(1605, 4, 390, 1578, '范围法是用轮廓线、颜色、网纹、符号、注记及面状符号，表示呈间断、成片或零星散布现象的分布范围及质量特征的方法。\n质底法是用颜色、网纹或面状符号，表示呈现连续分布且不满整个制图区域的各种现象的质量特征的方法。\n相同点：表示方法相近，表达现象特征相同，均采用底色、网纹或面状符号，表示面状现象的质量特征。\n不同点：\n（1）前者范围可以重叠，在范围外无此类现象的地区也可以空白，后者分区不可能重叠，全区也无空白\n（2）前者范围是各自独立、互不依存的，不同现象的范围轮廓的概括程度也不一定是同等的，后者各区域则是在统一的原则和要求下，经过科 学的概括而划分的，区域间关系密切。\n（3）前者同一种颜色或晕线网纹只代表一种具体的现象范围，后者同一颜色有时固定代表每一类现象，有的则不一定，而仅仅用以表示区域单元的差别。', 0, 142546, '2016-09-08 17:07:45'),
(1606, 4, 390, 1578, '相同点:1，表示呈面状分布的制图对象2.反映制图对象的质量特征3.表示方法相同。不同点1.质地法反映的是成连续分布的面状现象，而范围法反映的是呈间接的呈片的状分布的面状现象2，范围法可重叠，有空白，有交叉，质地法，无重叠，无空白，无交叉。', 0, 142597, '2016-09-08 17:07:54'),
(1607, 4, 378, 1179, '易维修 使用方便 操作简单 ', 0, 146245, '2016-09-08 17:22:06'),
(1608, 4, 378, 1179, '施工安全，', 0, 145592, '2016-09-08 17:31:35'),
