(1799, 4, 390, 1578, '相同点:1，表示呈面状分布的制图对象2.反映制图对象的质量特征3.表示方法相同。不同点1.质地法反映的是成连续分布的面状现象，而范围法反映的是呈间接的呈片的状分布的面状现象2，范围法可重叠，有空白，有交叉，质地法，无重叠，无空白，无交叉。', 0, 142587, '2016-09-09 12:37:14'),
(1800, 4, 390, 1578, '相同点:1，表示呈面状分布的制图对象2.反映制图对象的质量特征3.表示方法相同。不同点1.质地法反映的是成连续分布的面状现象，而范围法反映的是呈间接的呈片的状分布的面状现象2，范围法可重叠，有空白，有交叉，质地法，无重叠，无空白，无交叉。', 0, 142604, '2016-09-09 13:06:24'),
(1801, 4, 395, 1716, '两者起到对比作用，消费者购买时会有价格的比较，给消费者提供对比空间从而选择合适的商品', 0, 149481, '2016-09-09 13:07:33'),
