(1807, 4, 405, 0, '特许连锁模式的优缺点是什么？', 118223, 0, '2016-09-12 06:56:32'),
(1808, 4, 405, 1807, '优点，受资金限制小，有利于迅速扩张', 0, 149228, '2016-09-12 07:56:11'),
(1809, 4, 405, 1807, '缺点，门店缺少自主权', 0, 149228, '2016-09-12 07:56:49'),
(1810, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。 （2）受许人可以得到特许经营企业系统的管理培训和指导。 （3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。 （4）特许经营企业集中进货，降低成本，保证货源。 　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 （2）支付昂贵的特许经营费，利润要按协议与特许人共享。 （3）必须接受特许经营企业统一的供货价格。 （4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149220, '2016-09-12 07:56:55'),
(1811, 4, 405, 1807, '特许连锁模式的优点是特别许可', 0, 149156, '2016-09-12 07:57:13'),
(1812, 4, 405, 1807, '优点:门店负责人的动力大于直营连锁模式       \n缺点:门店缺少自主权', 0, 149200, '2016-09-12 07:57:16'),
(1813, 4, 405, 1807, '优点:受资金限制小，有利于迅速扩张；\n      降低双方的经营风险；\n缺点:门店缺少自主权；', 0, 149241, '2016-09-12 07:58:29'),
(1814, 4, 405, 1807, '优点：特许经营企业集中进货，降低成本，保证货源。 缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 ', 0, 149270, '2016-09-12 07:58:48'),
(1815, 4, 405, 1807, '优点:受资金限制小，有利于扩张\n2.门店负责人动力大\n3.降低双方经营风险\n缺点:门店缺少自主权\n2.特许人决策失误会直接影响受益人利益', 0, 149193, '2016-09-12 07:58:51'),
(1816, 4, 405, 1807, '优点:负责人动力大于直营；受资金限制较小，易于迅速扩张\n缺点:门店缺少自主权', 0, 149262, '2016-09-12 07:59:19'),
(1817, 4, 405, 1807, '优点，受资金限制小，有利于迅速扩张', 0, 149234, '2016-09-12 07:59:41'),
(1818, 4, 405, 1807, '优点：1.受资金限制较小，有利于迅速扩张2.门店负责人动力大于直营连锁模式3.降低双方经营风险', 0, 149275, '2016-09-12 07:59:44'),
(1819, 4, 405, 1807, '资金需求小，扩张速度快', 0, 149161, '2016-09-12 07:59:50'),
(1820, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149218, '2016-09-12 08:00:08'),
(1821, 4, 405, 1807, '利用特许经营模式 对于特许人和加盟商来讲是个双赢的模式， 简单讲，特许人来讲我有项目 我有经营资源，而加盟商你有资金 有意向，我们的合作结果是特许人提升了影响力，扩大了规模，加盟商从一个门外汉直接跨入了期望中的行业，并且取得收益。', 0, 149263, '2016-09-12 08:00:12'),
(1822, 4, 405, 1807, '特许连锁模式只能在某个领域发展，不能多方面发展，相对来说比较单一。', 0, 149210, '2016-09-12 08:00:18'),
(1823, 4, 405, 1807, '优点：1，受资金限制较小，有利于迅速扩张。2.门店负责人动力大于直营连锁形势。3.降低双方的经营风险\n缺点：1.特许人决策失误会直接影响受许人利益2.门店缺少自主权', 0, 149264, '2016-09-12 08:00:26'),
(1824, 4, 405, 1807, '1．特许连锁的优点\n    (1)对特许者有利。 (2)对被特许者有利。(3)对社会有利。\n 2．特许连锁的缺点\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n    (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。', 0, 149268, '2016-09-12 08:00:38'),
(1825, 4, 405, 1807, '缺点:门店缺少自主权\n优点:受资金限制小，有利于迅速扩张', 0, 149183, '2016-09-12 08:00:43'),
(1826, 4, 405, 1807, '高度集权管理可以统一调度资金，统一经营战略，统一管理人事，统一开发和利用企业整体性资源，具有雄厚的实力，易于同金融机构、生产厂家打交道，可以充分规划企业的发展规模和速度，在新产品开发与推广、信息管理现代化方面也能发挥出整体优势。但是直营连锁也有难以克服的自身缺陷，由于直营连锁以单一资本向市场辐射，各门店由总部投资一家家兴建，因而易受资金、人力、时间等方面的影响，发展规模和速度有限。此外，各分店自主权小，利益关系不紧密，其主动性、积极性、创造性难以发', 0, 149150, '2016-09-12 08:00:57'),
(1827, 4, 405, 1807, '优点:1.受资金限制小，有利于扩张 2.门店负责人动力大 3.降低双方经营风险 缺点:门店缺少自主权 2.特许人决策失误会直接影响受益人利益', 0, 149250, '2016-09-12 08:01:01'),
(1828, 4, 405, 1807, '（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。 （2）受许人可以得到特许经营企业系统的管理培训和指导。 （3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。 （4）特许经营企业集中进货，降低成本，保证货源。 　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 （2）支付昂贵的特许经营费，利润要按协议与特许人共享。 （3）必须接受特许经营企业统一的供货价格。 （4）一个特许经营加盟企业出现问题，会连累所有企业', 0, 149237, '2016-09-12 08:01:03'),
(1829, 4, 405, 1807, '优点：用较少的钱快速的发展规模\n缺点：总部难以管理\n', 0, 149151, '2016-09-12 08:01:14'),
(1830, 4, 405, 1807, '优点：1.受资金限制较小，有利于迅速扩张2.门店负责人动力大于直营连锁模式3.降低双方经营风险', 0, 149256, '2016-09-12 08:01:16'),
(1831, 4, 405, 1807, '高度集权管理可以统一调度资金，统一经营战略，统一管理人事，统一开发和利用企业整体性资源，具有雄厚的实力，易于同金融机构、生产厂家打交道，可以充分规划企业的发展规模和速度，在新产品开发与推广、信息管理现代化方面也能发挥出整体优势。但是直营连锁也有难以克服的自身缺陷，由于直营连锁以单一资本向市场辐射，各门店由总部投资一家家兴建，因而易受资金、人力、时间等方面的影响，发展规模和速度有限。此外，各分店自主权小，利益关系不紧密，其主动性、积极性、创造性难以发', 0, 149150, '2016-09-12 08:01:20'),
(1832, 4, 405, 1807, '优点:1.受资金限制较小，有利于迅速扩大2.门店负责人动力大于直营连锁模式3.降低双方的经营风险缺点:1.特许人决策失误会直接影响受许人得益2.门店缺少自主权', 0, 149223, '2016-09-12 08:01:41'),
(1833, 4, 405, 1807, '我就给你这么说吧 利用特许经营模式 对于特许人和加盟商来讲是个双赢的模式， 你要说对谁更有利，这个问题就有点功利了，关键在于雪中送炭还是锦上添花， 简单讲，特许人来讲我有项目 我有经营资源，而加盟商你有资金 有意向，我们的合作结果是特许人提升了影响力，扩大了规模，加盟商从一 个门外汉直接跨入了期望中的行业，并且取得收益。这是正常模式', 0, 149258, '2016-09-12 08:01:59'),
(1834, 4, 405, 1807, '优点:受资金限制小，有利于扩张 2.门店负责人动力大 3.降低双方经营风险 缺点:门店缺少自主权 2.特许人决策失误会直接影响受益人利益缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。', 0, 149263, '2016-09-12 08:02:00'),
(1835, 4, 405, 1807, '优点，受资金限制小，有利于迅速扩张；门店负责人动力大；降低双方的经营风险\n缺点，门店缺少自主权；利益有共同性', 0, 149139, '2016-09-12 08:02:06'),
(1836, 4, 405, 1807, '     1．特许连锁的优点\n    (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n    (2)对被特许者有利。第一，可利用总部成功的经验，经营受到市场认可和欢迎的商品及服务，成功机会大，风险小；第二，可获得总部持续的业务指导；第三，可享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n    (3)对社会有利。以特许连锁方式来开拓和发展社会的商业网点，可以提高商业的组织化程度，并且大大有助于中小型商业企业的生存和发展。\n    2．特许连锁的缺点\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n    (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。', 0, 149239, '2016-09-12 08:02:12'),
(1837, 4, 405, 1807, '缺点：1.特许人决策失误会直接影响受许人利益2.门店缺少自主权', 0, 149256, '2016-09-12 08:02:22'),
(1838, 4, 405, 1807, '优点 是对特许者有利，对被特许者有利。 缺点 是由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。', 0, 149142, '2016-09-12 08:02:33'),
(1839, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。\n', 0, 149141, '2016-09-12 08:02:43'),
