(1851, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149245, '2016-09-12 08:04:07'),
(1852, 4, 405, 1807, '缺点：1.特许人决策失误会直接影响受许人利益2.门店缺少自主权', 0, 149275, '2016-09-12 08:04:13'),
(1853, 4, 405, 1807, '特许连锁的优点\n\n     第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n特许连锁的缺点\n\n      (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n\n      (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n\n      (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。', 0, 149254, '2016-09-12 08:04:16'),
(1854, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149274, '2016-09-12 08:04:18'),
(1855, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149217, '2016-09-12 08:04:42'),
(1856, 4, 405, 1807, '优点：1.特许经营首先是该地区或者是一片商业区的经营垄断，免去很多竞争对手，同类同款产品的麻烦。\n2.给顾客的感觉不一样，分析顾客心理就知道有特许经营的牌照，可以让顾客觉得你才是正宗，比较可信。\n3.特许经营的优点还有可以免去你自己选择和进货时候价格不好定位的麻烦。\n缺点：\n特许经营的种类比较单一，更新换代不如其他东西，同样顾客和自己进货的选择性就差了很多。\n也许同类里面出来山寨版的东西。就限制了你的经营了，因为特许经营是不允许出售其他同类产品的', 0, 149273, '2016-09-12 08:04:49'),
(1857, 4, 405, 1807, '优点:可以用较少的资金和有限人员，可利用总部成功的经验，成功机会大，风险小，有助于中小型商业企业的生存和发展\n缺点：阻碍加盟者积极性的发挥，容易限制经营的灵活性，如进货的渠道受到限制等。', 0, 149246, '2016-09-12 08:04:53'),
(1858, 4, 405, 1807, '保证货源。 　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 （2）支付昂贵的特许经营费，利润要按协议与特许人共享。 （3）必须接受特许经营企业统一的供货价格。 （4）一个特许经营加盟企业出现问题，会连累所有企业。\n董盼娣\n优点：1.受', 0, 149196, '2016-09-12 08:05:07'),
(1859, 4, 405, 1807, '优点：1受许人可以得到特许经营企业系统的管理培训和指导。\n2可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n3许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。', 0, 149194, '2016-09-12 08:05:12'),
(1860, 4, 405, 1807, '优点便于管理', 0, 149204, '2016-09-12 08:05:12'),
(1861, 4, 405, 1807, '自主经营性方面收到限制', 0, 149195, '2016-09-12 08:05:16'),
(1862, 4, 405, 1807, '优点:有助于企业规模的快速发展。缺点', 0, 149187, '2016-09-12 08:05:22'),
(1863, 4, 405, 1807, '优点：投资风险小，降低成本，保证货源    缺点：经营方式上没有自主权，增长受限制', 0, 149144, '2016-09-12 08:05:22'),
(1864, 4, 405, 1807, '特许连锁的优点\n    (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。特许连锁的缺点\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n    ', 0, 149155, '2016-09-12 08:05:23'),
(1865, 4, 405, 1807, '1.以较低经营成本，扩大经营范围，迅速抢占市场份额；\n2.通过连锁加盟体系达到规模经济，从而获得更大经济效益与宣传效果。\n3.拥有多项无形资产作为特许权，包括经营技术、商标、形象表示等，一经开发，可以长期获利；\n4.连锁加盟总部有多项稳定的收益保障，包括全国各地加盟商加盟金与营业额提成等方式。\n有利于被特许加盟商\n1. 获得特许总部持续的经营指导，解决加盟商后顾之忧。\n2. 复制总部成功经营模式，快速得到当地市场认可、欢迎与支持。成功几率大，风险小，收益相对有保障。\n3. 共享特许连锁加盟总部信息、品牌宣传效果、信誉、各项售后支持，降低经营成本，享受规模经济成果。\n3.享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n有利于社会\n成功的特许企业拥有成熟的商业模式、广阔的市场、优秀的产品。特许连锁模式可以快速提升当地本行业的市场水平，提高商业的组织化程度，为中小型企业开拓了一条全新的道路。\n特许连锁模式缺点\n1. 部分特许企业片面追求加盟商数量，超速拓展加盟市场，售后服务体系却较难跟上，后续管理乏力，严重损害辛苦建立起的企业品牌形象，损害被特许者的利益，甚至使整个特许连锁加盟体系陷入崩溃的边缘。\n2. 部分加盟商缺乏自主性，过分依赖特许企业总部，阻碍其发展。\n3. 特许总部往往会要求加盟商标准化经营，缺乏一定的灵活性与变通性。不过，加盟商在遇到特殊情况时，与特许总部协商。', 0, 149272, '2016-09-12 08:05:24'),
(1866, 4, 405, 1807, '优点：1.特许经营首先是该地区或者是一片商业区的经营垄断，免去很多竞争对手，同类同款产品的麻烦。\n2.给顾客的感觉不一样，分析顾客心理就知道有特许经营的牌照，可以让顾客觉得你才是正宗，比较可信。\n3.特许经营的优点还有可以免去你自己选择和进货时候价格不好定位的麻烦。\n缺点：\n特许经营的种类比较单一，更新换代不如其他东西，同样顾客和自己进货的选择性就差了很多。\n也许同类里面出来山寨版的东西。就限制了你的经营了，因为特许经营是不允许出售其他同类产品的', 0, 149273, '2016-09-12 08:05:27'),
(1867, 4, 405, 1807, '（1）受许人可以得到特许经营企业系统的管理培训和指导。 （2）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 （2）支付昂贵的特许经营费，利润要按协议与特许人共享。', 0, 149137, '2016-09-12 08:05:33'),
(1868, 4, 405, 1807, '优点：1  投资风险小  2  受许人可以得到特许经营企业系统的管理和培训  3   特许经营企业集中进货，降低成本，保证货源。缺点：1  门店缺少自主权  2支付昂贵的特许经营费', 0, 149186, '2016-09-12 08:05:38'),
