(1871, 4, 405, 1807, '优点:1、投资风险小 \n         2、受许人可得到管理培训和指导员 \n        3、集中进货，降低陈本\n缺点:1、没有自主权增长受限制\n          2、出现问题有连带性\n          3、支付昂贵的特许经营费', 0, 149146, '2016-09-12 08:06:15'),
(1872, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149203, '2016-09-12 08:06:24'),
(1873, 4, 405, 1807, '优点:受资金限制较小，有利于迅速扩张。门店负责人动力大于直营连锁形式。降低双方的经营风险。\n缺点:门店缺少自主权。特许人决策失误会直接影响受许人利益。', 0, 149166, '2016-09-12 08:06:24'),
(1874, 4, 405, 1807, '优点：可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。', 0, 149174, '2016-09-12 08:06:25'),
(1875, 4, 405, 1807, '优点：　　（1）投资风险小，并且可以得到特许人金融方面的帮助。（2）受许人可以得到特许经营企业系统的管理培训和指导。（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。（4）特许经营企业集中进货，降低成本，保证货源。　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。（2）支付昂贵的特许经营费，利润要按协议与特许人共享', 0, 149178, '2016-09-12 08:06:30'),
(1876, 4, 405, 1807, '优点      (1)资金投入和运行成本很低，基本实现“无形资产扩张” (2)扩张速度快。主导企业可将那些已“先天”占有良好商业位置的企业纳入自己的连锁体系中来。\n\n      (3)主导企业的经营和扩张风险小。因为主要由加盟企业来承担。\n\n      特许连锁的缺点是：总部和加盟店之间容易发生违约纠纷，监督和协调成本比较高，尤其容易发生加盟店违规向外采购、降低服务质量、损害主导企业商誉和利益的问题。为此，主导企业应该适当控制加盟店的数量，使其与自身的监督能力相适应。', 0, 149225, '2016-09-12 08:06:32'),
(1877, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149176, '2016-09-12 08:06:36'),
(1878, 4, 405, 1807, '优点：投资风险小；集中进货，降低成本，保证货源；受许人可以得到特许经营企业系统的管理培训和指导。缺点：没有自主权；支付高昂的经营费；一个加盟企业出现问题，会连累所有企业。', 0, 149131, '2016-09-12 08:06:47'),
(1879, 4, 405, 1807, '优点：有利于企业规模的快速发展，对特许者有利缺点：缺乏经营的灵活性，自主性。不能提供强有力的服务保障', 0, 149199, '2016-09-12 08:07:05'),
(1880, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。', 0, 149157, '2016-09-12 08:07:09'),
(1881, 4, 405, 1807, '优点：1 投资风险小 2 受许人可以得到特许经营企业系统的管理和培训 3 特许经营企业集中进货，降低成本，保证货源。缺点：1 门店缺少自主权 2支付昂贵的特许经营费', 0, 149201, '2016-09-12 08:07:10'),
(1882, 4, 405, 1807, '优点：成本低，受资金限制小\n缺点：门店缺少主动权，一个特许连锁加盟企业出现问题，会连累所有企业', 0, 149179, '2016-09-12 08:07:13'),
(1883, 4, 405, 1807, '特许连锁的优点\n\n      (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n\n      (2)对被特许者有利。第一，可利用总部成功的经验，经营受到市场认可和欢迎的商品及服务，成功机会大，风险小；第二，可获得总部持续的业务指导；第三，可享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n\n      (3)对社会有利。以特许连锁方式来开拓和发展社会的商业网点，可以提高商业的组织化程度，并且大大有助于中小型商业企业的生存和发展。\n\n      2．特许连锁的缺点\n\n      (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n\n      (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n\n      (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。', 0, 149203, '2016-09-12 08:07:22'),
(1884, 4, 405, 1807, '优点：总部成本低、缺点：加盟者运行自由度高', 0, 149235, '2016-09-12 08:07:34'),
(1885, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149260, '2016-09-12 08:07:36'),
(1886, 4, 405, 1807, '优点，资金链不易断开，所以门店不会因为资金的问题而关闭，\n缺点，缺少自主权，', 0, 149205, '2016-09-12 08:07:46'),
(1887, 4, 405, 1807, '，首先连锁经营的被授权人购买的是一斤非常成功成熟的运营系统，上手快，不用经历自己创业中的模式过程，极大的降低了经营风险，而且连锁经营的经营启动成本低于其它商业模式，而连锁经营的优缺点自然有缺点存在，授权方对于被授权方的一致性要求很严格，所以连锁店比较受制于总店，商品都是标准化、规格化，因为合同的限制。自由度不高，但总体来说连锁经营的优缺点，优点还是大于缺点的', 0, 149255, '2016-09-12 08:08:06'),
(1888, 4, 405, 1807, '优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。', 0, 149157, '2016-09-12 08:08:15'),
(1889, 4, 405, 1807, '优点：　　（1）投资风险小，并且可以得到特许人金融方面的帮助。（2）受许人可以得到特许经营企业系统的管理培训和指导。（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。（4）特许经营企业集中进货，降低成本，保证货源。　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。（2）支付昂贵的特许经营费，利润要按协议与特许人共享', 0, 149224, '2016-09-12 08:08:51'),
(1890, 4, 405, 1807, '易扩张  ', 0, 149192, '2016-09-12 08:08:58'),
(1891, 4, 405, 1807, '利用特许经营模式 对于特许人和加盟商来讲是个双赢的模式， 你要说对谁更有利，这个问题就有点功利了，关键在于雪中送炭还是锦上添花， 简单讲，特许人来讲我有项目 我有经营资源，而加盟商你有资金 有意向，我们的合作结果是特许人提升了影响力，扩大了规模，加盟商从一个门外汉直接跨入了期望中的行业，并且取得收益。这是正常模式', 0, 149259, '2016-09-12 08:09:24');
INSERT INTO `discussion` (`id`, `schoolid`, `classid`, `fid`, `content`, `creatid`, `replyid`, `addtime`) VALUES
(1892, 4, 405, 1807, '资金的问题而关闭， 缺点，缺少自主权，\n胡春喜\n优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。 （2）受许人可以得到特许经营企业系统的管理培训和指导。 （3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。 （4）特许经营企业集中进货，降低成本，保证货源。 　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。 （2）支付昂贵的特许经营费，利润要按协议与特许人共享。 （3）必须接受特许经营企业统一的供货价格。 （4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149251, '2016-09-12 08:09:24'),
(1893, 4, 405, 1807, '扩张速度快。主导企业可将那些已“先天”占有良好商业位置的企业纳入自己的连锁体系中来。', 0, 149247, '2016-09-12 08:09:30'),
(1894, 4, 405, 1807, '优点  可以最大程度的进行品牌推广，渗透到社会生活中，让更多的人熟知，获得更多利益。  缺点，与每个店面的管理人员的管理方式息息相关，可能出现一家名誉受损而连累其他店面。', 0, 149202, '2016-09-12 08:10:06'),
(1895, 4, 405, 1807, '因为特许连锁必须有一个主导的企业，所以特许人的决策失误会直接影响受许人利益，但是由于特许连锁规模不大，人员利于管理和培训，', 0, 149130, '2016-09-12 08:10:44'),
(1896, 4, 405, 1807, '优点:1.受资金限度小，有利于迅速扩展2.特许经营门店负责人动力大于连锁经营，3.能降低双方风险\n缺点:1.决策决定特许人收入，2.门店缺少自主权', 0, 149140, '2016-09-12 08:10:56'),
(1897, 4, 405, 1807, '优点：受资金限制较小，有利于迅速扩张      缺点： 门店缺少自主权', 0, 149171, '2016-09-12 08:11:32'),
(1898, 4, 405, 1807, '优点：受资金限制小，有利于迅速扩张门店，缺点：门店缺少自主权', 0, 149180, '2016-09-12 08:11:50'),
(1899, 4, 405, 1807, '优点，s受资金限制小，门店可以快速增长。\n缺点，缺少自主权', 0, 149205, '2016-09-12 08:12:14'),
(1900, 4, 405, 1807, '优点：受资金限制较小，有利于迅速扩张。2.门店负责人动力大于直营连锁模式3.降低双方的经营风险4.投资风险小，集中进货，降低成本\n缺点：1.特许人决策失误会直接影响受许人利益2.门店缺少自主权3.支付昂贵的特许经营费', 0, 149135, '2016-09-12 08:13:10'),
(1901, 4, 405, 1807, '优点:1.受资金限制小，有利于迅速扩张。2.门店负责人动力大于执营连锁形式    缺点:门店缺少自主权，特许人决策失误会直接影响受许人的利益。', 0, 149149, '2016-09-12 08:13:24'),
(1902, 4, 405, 1807, '优点，受资金限制小，有利于迅速扩张，缺点，门店缺少自主权', 0, 149238, '2016-09-12 08:13:40'),
(1903, 4, 405, 1807, '优点，受资金限制小，有利于迅速扩张，缺点，门店缺少自主权', 0, 149238, '2016-09-12 08:13:47'),
(1904, 4, 405, 1807, '优点:1·加盟信誉高的特许经营企业可以降低投资风险，并且可以得到一定的金融方面的帮助；\n    2·受许人可以得到特许经营企业系统的管理和培训；\n        3·特许经营企业集中进货，降低成本，保证货源；\n缺点:1.在经营方式上没有自主权，受到特许人的限制；\n    2·必须要接受特许企业统一的供货价格； \n        3·特许经营加盟企业出现问题会影响整个企业；', 0, 149209, '2016-09-12 08:15:55'),
(1905, 4, 405, 1807, '优点：受资金限制小，有利于快速增长；降低双方的经营风险。 缺点：特许人决策失误会直接影响受许人利益；门店缺少自主权', 0, 149163, '2016-09-12 08:20:01'),
(1906, 4, 405, 1807, '优势，受资金限制小，有利于迅速发展。   缺点，门店缺乏自主权', 0, 149197, '2016-09-12 08:32:29'),
(1907, 4, 405, 0, '快递企业的物流体系建设适用于什么样的连锁模式？', 118223, 0, '2016-09-12 08:49:47'),
