(1909, 4, 405, 1807, '\n优点：　　（1）加盟一家实力雄厚和信誉高的特许经营企业，投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，有利于提高竞争力。\n（4）特许经营企业集中进货，降低成本，保证货源。\n　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149189, '2016-09-12 08:50:32'),
(1910, 4, 405, 1807, '优点:1.手资金限制较小，有利于迅速扩张2.门店负责人动力大于直营连锁\n缺点:1.特许人决策失误会直接影响受许人利益2.门店缺少自主权。', 0, 149231, '2016-09-12 08:50:40'),
(1911, 4, 405, 1807, '优点:1.受资金限度小，有利于迅速扩展2.特许经营门店负责人动力大于连锁经营，3.能降低双方风险 缺点:1.决策决定特许人收入，2.门店缺少自主权', 0, 149213, '2016-09-12 08:55:17'),
(1912, 4, 405, 1807, '优点:投资的风险小，可以得到特许人的帮助，培训和指导。集中进货，降低成本，保证货源。缺点:没有自主权，受到特许人限制，利润要和特许人共享。', 0, 149169, '2016-09-12 08:55:55'),
(1913, 4, 405, 1807, '优点1，受资金限制小有利于迅速扩张\n         2，门店负责人动力大于直营连锁形式\n         3，降低双方的的经营风险\n  缺点1，特许人决策失误会直接受许人利益 \n       2，门店缺少自主权', 0, 149167, '2016-09-12 08:56:23'),
(1914, 4, 405, 1807, '特许连锁 优点：扩张快、风险小、投入小 缺点：管理难', 0, 149132, '2016-09-12 08:57:34'),
(1915, 4, 405, 1807, '优点：　　（1）投资风险小，并且可以得到特许人金融方面的帮助。（2）受许人可以得到特许经营企业系统的管理培训和指导。（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。（4）特许经营企业集中进货，降低成本，保证货源。　　缺点：（1）经营方式上没有自主权，受制于特许人，使其增长受限制。（2）支付昂贵的特许经营费，利润要按协议与特许人共享', 0, 149167, '2016-09-12 08:58:14'),
(1916, 4, 405, 1807, '优点：受资金限制小，有利于快速增长；降低双方的经营风险。 缺点：特许人决策失误会直接影响受许人利益；门店缺少自主权', 0, 149207, '2016-09-12 09:01:47'),
(1917, 4, 405, 1807, '优点:1.受资金限制小，有利于迅速扩张。2.门店负责人动力大于执营连锁形式 缺点:门店缺少自主权，特许人决策失误会直接影响受许人的利益。', 0, 149265, '2016-09-12 09:08:51'),
(1918, 4, 405, 1907, '自由连锁，我认为快递的规模越大越好，网点覆盖范围大才能有更多的客源，和升值的利润空间，进而取得更大的发展空间', 0, 149212, '2016-09-12 09:18:17'),
(1919, 4, 405, 1807, '受资金限制小 扩张迅速', 0, 149129, '2016-09-12 09:18:34'),
(1920, 4, 405, 1807, '     1．特许连锁的优点\n\n    (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n\n    (2)对被特许者有利。第一，可利用总部成功的经验，经营受到市场认可和欢迎的商品及服务，成功机会大，风险小；第二，可获得总部持续的业务指导；第三，可享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n\n    (3)对社会有利。以特许连锁方式来开拓和发展社会的商业网点，可以提高商业的组织化程度，并且大大有助于中小型商业企业的生存和发展。\n\n    2．特许连锁的缺点\n\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n\n    (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。\n\n     1．特许连锁的优点\n\n    (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n\n    (2)对被特许者有利。第一，可利用总部成功的经验，经营受到市场认可和欢迎的商品及服务，成功机会大，风险小；第二，可获得总部持续的业务指导；第三，可享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n\n    (3)对社会有利。以特许连锁方式来开拓和发展社会的商业网点，可以提高商业的组织化程度，并且大大有助于中小型商业企业的生存和发展。\n\n    2．特许连锁的缺点\n\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n\n    (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。\n\n     1．特许连锁的优点\n\n    (1)对特许者有利。第一，可以用较少的资金和有限人员，迅速开展事业，占领市场，扩大经营；第二，可以获得连锁经营体系所带来的规模效益；第三，可以以经营技术、商标、形象标识等无形资产等作为特许权，一次开发投入，多次长期获利；第四，可以用加盟金和经营额提成等方式获得回报，收益有保障。\n\n    (2)对被特许者有利。第一，可利用总部成功的经验，经营受到市场认可和欢迎的商品及服务，成功机会大，风险小；第二，可获得总部持续的业务指导；第三，可享受连锁系统的广泛信息、共同性促销活动及总部的信誉和支持，获得规模效益带来的低成本优势。对于那些具有一定资本、希望介入商业但缺乏经营技术和市场经验的企业或个人而言，通过加盟的确是一个很好的创业方式和发展机会。\n\n    (3)对社会有利。以特许连锁方式来开拓和发展社会的商业网点，可以提高商业的组织化程度，并且大大有助于中小型商业企业的生存和发展。\n\n    2．特许连锁的缺点\n\n    (1)由于加盟者缺乏经营自主性，往往阻碍其积极性的发挥。\n\n    (2)由于强调标准化的经营要求，容易限制经营的灵活性，如进货的渠道受到限制等。\n\n    (3)由于有些特许者片面追求品牌授权金，超量发展加盟店而管理乏力，不能提供强有力的服务保障，不仅严重贬损连锁企业形象，而且损害加盟者权益，甚至可能导致特许系统的整体崩溃。\n扩张快，风险小哦\n但是缺少自主权\n', 0, 149230, '2016-09-12 09:18:38'),
(1921, 4, 405, 1907, '特许，现如今快递品牌越来越多，名气较大的也有。利用品牌优势去争取利润，品牌效应增强消费者信心，特许用的就是得天独厚的优势，有上面的支持，还有顾客对品牌的信心。很快就会适应的', 0, 149195, '2016-09-12 09:18:38'),
(1922, 4, 405, 1807, '优点：扩张快、风险小、投入小 缺点：管理难', 0, 149227, '2016-09-12 09:19:16'),
(1923, 4, 405, 1907, '\n直营:经营管理统一化，易于发挥整体优势 服务水平高 员工队伍稳定 信息化程度高', 0, 149278, '2016-09-12 09:19:45'),
(1924, 4, 405, 1907, '特许：启动成本低，发展速度快，利润高', 0, 149224, '2016-09-12 09:19:46'),
(1925, 4, 405, 1907, '加盟型（特许权经营模式）是指特许经营机构将自己拥有的商标、专利和专有技术等，以特许经营合同的形式授予被特许者使用，被特许者按合同规定在统一的业务模式下在特定区域从事经营活动并支付相应的费用。其中代表性的企业有申通快递、韵达快递等。\n　　直营型是指由公司总部直接经营、投资、管理各分子公司的经营模式。各分公司在总公司的管理下进行经营活动。\n3.自由连锁经营.因为自主经营权较大，有利于调动门店的积极性', 0, 149264, '2016-09-12 09:20:22'),
(1926, 4, 405, 1907, '特许连锁也不错，但是不适用于经济不发达的地区', 0, 149212, '2016-09-12 09:20:31'),
(1927, 4, 405, 1907, '答：快递企业适合特许连锁经营模式', 0, 149180, '2016-09-12 09:20:35'),
(1928, 4, 405, 1807, '优点:特许经营企业集中进货，降低成本，保证货源。缺点:必须接受特许经营企业统一的供货价格。', 0, 149219, '2016-09-12 09:20:40'),
(1929, 4, 405, 1907, '快递企业适合连锁加盟的模式，。理由如下，1.加盟的成本低，发展好2.降低创业风险3.缩短创业摸索期', 0, 149197, '2016-09-12 09:20:58'),
(1930, 4, 405, 1907, '自营配送是指连锁企业物流配送的各个环节由企业自身筹建并组织管理，实现对企业内部和外部货物配送的模式。自营配送便于各环节的协调配合，可以对物流系统运作的全过程进行有效的控制，同时可以降低交易成本，避免商业秘密的泄露，但由于前期投入较高，适合规模较大的连锁企业。', 0, 149226, '2016-09-12 09:21:05'),
(1931, 4, 405, 1807, '优点：容易打造品牌经营，知名度较高，吸引眼球，客户也会越来越多，\n缺点:不能因地制宜，统一的管理制度会带来一些不方便，直接影响店里的Ji利润。', 0, 149185, '2016-09-12 09:21:24'),
(1932, 4, 405, 1807, '风险小，不容易出现问题，但管理起来很麻烦', 0, 149182, '2016-09-12 09:21:33'),
(1933, 4, 405, 1907, '直营，直营连锁管理能力强，较为好管理，快递效率也高，各个快递点能够统一管理。', 0, 149218, '2016-09-12 09:21:34'),
(1934, 4, 405, 1907, '特许连锁加盟模式由于其本身所具有的功能优势，在很长的时期范围内都有其存在的价值，不会有被淘汰的危险。', 0, 149178, '2016-09-12 09:21:35'),
(1935, 4, 405, 1907, '特许经营，避免地方重复经营，启动成本低，方便建立更多的收发站点，', 0, 149142, '2016-09-12 09:21:54'),
(1936, 4, 405, 1907, '特许…资金限制少，利于迅速扩张，降低双方风险', 0, 149230, '2016-09-12 09:21:54'),
(1937, 4, 405, 1907, '自营：这样有利于管理者根据实际情况来制定不同的战略', 0, 149133, '2016-09-12 09:21:56'),
(1938, 4, 405, 1907, '自由连锁  可以覆盖更多的范围', 0, 149202, '2016-09-12 09:22:00'),
(1939, 4, 405, 1907, '加盟型（特许权经营模式）是指特许经营机构将自己拥有的商标、专利和专有技术等，以特许经营合同的形式授予被特许者使用，被特许者按合同规定在统一的业务模式下在特定区域从事经营活动并支付相应的费用。', 0, 149199, '2016-09-12 09:22:01'),
(1940, 4, 405, 1907, '1、遍布区域广   2、门店数量多   3、人力资源丰富', 0, 149146, '2016-09-12 09:22:04'),
(1941, 4, 405, 1907, '直营型是指由公司总部直接经营、投资、管理各分子公司的经营模式。各分公司在总公司的管理下进行经营活动。 ', 0, 149137, '2016-09-12 09:22:11'),
(1942, 4, 405, 1907, '自由连锁模式更适合快递行业，自由连锁可以由很多个单店组成比较随意的联盟，完全可以多家快递公司联盟，分区管理，网状覆盖，扩大其规模，达到利润的最大化，同时各个物流企业又有独立的企业法人和财务管理，即可以互不干涉主权，又可以互相交流，又可以扩大自己的利润，并且可以自由结合，相对来说更有自主权。', 0, 149210, '2016-09-12 09:22:14'),
(1943, 4, 405, 1907, '适合连锁经营模式', 0, 149267, '2016-09-12 09:22:24'),
(1944, 4, 405, 1907, '特许的分布会越来越广，点点分布，依靠高质量的团队，才能确立信心', 0, 149195, '2016-09-12 09:22:26'),
(1945, 4, 405, 1807, '优点：（1）投资风险小，并且可以得到特许人金融方面的帮助。\n（2）受许人可以得到特许经营企业系统的管理培训和指导。\n（3）可以享受特许经营企业大规模的广告宣传等各种促销活动。使用公众所熟悉的特许经营企业的服务商标、产品商标、所有权、专利与外观设计，利于提高竞争力。\n（4）集中进货，降低成本。\n　　缺点：（1）经营方式上受制于特许人，增长受限制。\n（2）支付昂贵的特许经营费，利润要按协议与特许人共享。\n（3）必须接受特许经营企业统一的供货价格。\n（4）一个特许经营加盟企业出现问题，会连累所有企业。', 0, 149177, '2016-09-12 09:23:32'),
(1946, 4, 405, 1907, '自营  自营配送模式是指连锁快递企业借助于自身的物质条件，结合各分店的商品配送量、经营规模以及网点布局等多种条件与环境，选择适当的地点出资建立一个或几个配送中心，由公司总部对配送中心进行经营管理，完成对各分店的全部配送业务。第三方物流配送模式是指连锁零售企业将其需要完成的配送业务委托给第三方物流企业来运营的一种配送模式。供应商配送模式是指由供应商直接将连锁企业采购的商品在指定的时间范围内送到各连锁分店的配送模式。\n\n    自营配送模式既有沟通便捷、信息安全性高的优点，也有资金投入大、设备闲置多、对物流计划专业人才需求高的缺点。第三方物流配送模式下，商业企业虽然难以有效控制第三方物流的运作，容易形成对第三方物流的依赖，造成经营信息外泄；但可以有效降低设施设备的投资，通过与其它企业的共同配送提高设备利用率降低配送成本。供应商配送模式下，商品配送的正向物流可以同时实现商品退货的逆向物流，但其缺点在于小订单物流配送的费用往往较高。\n自营配送模式是指连锁快递企业借助于自身的物质条件，结合各分店的商品配送量、经营规模以及网点布局等多种条件与环境，选择适当的地点出资建立一个或几个配送中心，由公司总部对配送中心进行经营管理，完成对各分店的全部配送业务。第三方物流配送模式是指连锁零售企业将其需要完成的配送业务委托给第三方物流企业来运营的一种配送模式。供应商配送模式是指由供应商直接将连锁企业采购的商品在指定的时间范围内送到各连锁分店的配送模式。\n\n    \n', 0, 149258, '2016-09-12 09:23:53'),
(1947, 4, 405, 1907, '自由连锁，我认为快递的规模越大越好，网点覆盖范围大才能有更多的客源，和升值的利润空间，进而取得更大的发展空间，利用品牌优势去争取利润，品牌效应增强消费者信心，特许用的就是得天独厚的优势，有上面的支持，还有顾客对品牌的信心。', 0, 149237, '2016-09-12 09:23:54'),
(1948, 4, 405, 1907, '连锁经营，统一的管理制度，公司培训，省心省力，而且大大提高的工作效率', 0, 149185, '2016-09-12 09:24:04'),
(1949, 4, 405, 1807, '特许经营的优势:1、特许商利用特许经营实行大规模的低成本扩张2、加盟商借助特许经营"扩印底版"3、特许经营因其管理优势而受到消费者欢迎\n 特许经营的劣势\n     (1)、正是由于特许本身，使得加盟商得到了一套完善的、严谨的经营体系。可是，正因如此，加盟商很难改变这种经营模式来适应市场的、政策的各种变化。另外，由于各个地区消费者的需求不同，特许经营也很难在任何地方都能保持持续的优势。\n     (2)、对消费者来说，加盟商的频繁变更给他们带来的是疑惑，造成了特许人、现任加盟商和以往加盟商的之间的责任不清，相互推脱责任。\n     (3)、特许经营只能专注于某一个领域，而不可能在各个市场都取得战略性的胜利。', 0, 149240, '2016-09-12 09:24:06'),
(1950, 4, 405, 1907, '自营配送是指连锁企业物流配送的各个环节由企业自身筹建并组织管理，实现对企业内部和外部货物配送的模式。自营配送便于各环节的协调配合，可以对物流系统运作的全过程进行有效的控制，同时可以降低交易成本，避免商业秘密的泄露，但由于前期投入较高，适合规模较大的连锁企业。', 0, 149269, '2016-09-12 09:24:08'),
(1951, 4, 405, 1907, '直营，直营连锁管理能力强，较为好管理，能够统一配送，快递效率也高', 0, 149161, '2016-09-12 09:24:09'),
(1952, 4, 405, 1907, '特许，特许经营模式有助于企业规模的快速发展，快递公司应该在节约资金的基础上进一步扩大自己的规模，从而扩大市场占有率，提升自身的竞争力', 0, 149262, '2016-09-12 09:24:10'),
(1953, 4, 405, 1907, '特许，在加大品牌力度的同时，可以增设更多的快递点，能更加方便，也能更好的占领一定的市场。', 0, 149255, '2016-09-12 09:24:17'),
(1954, 4, 405, 1907, '特许和自由连锁相结合\n原因:1.可以发挥特许连锁的优点，有利于开拓扩张\n2.自由经营的权利较大，有利于调动门店积极性\n3.连着相结合，可以弱化缺点，统一性较好，经营决策执行力强\n', 0, 149193, '2016-09-12 09:24:23'),
