(1956, 4, 405, 1907, '加盟模式，加盟公司需要每年向总公司缴纳加盟费用，以及分摊某些部分的运营费用。但总体上说，加盟的成本要小于自营的。这是其中之一的优势，另外一个大的优势是网络丰富，点多，能提高客户范围和公司知名度。', 0, 149187, '2016-09-12 09:24:28'),
(1957, 4, 405, 1907, '快递企业的物流体系建设适用于自由经营模式，在自由经营模式下，快递企业的人力、物力、经营权全部都在总部，由总部统一分配，在使中小零售企业受益的同时，自愿连锁也能在维护流通秩序、吸纳就业等方面起到积极作用。', 0, 149156, '2016-09-12 09:24:30'),
