(1976, 4, 405, 1907, '答：适合特许经营模式，特许经营适合与服务业、制造业、餐饮业等行业的发展，而物流属于服务业。', 0, 149180, '2016-09-12 09:26:00'),
(1977, 4, 405, 1907, '自营自营配送模式既有沟通便捷、信息安全性高的优点，也有资金投入大、设备闲置多、对物流计划专业人才需求高的缺点。第三方物流配送模式下，商业企业虽然难以有效控制第三方物流的运作，容易形成对第三方物流的依赖，造成经营信息外泄；但可以有效降低设施设备的投资，通过与其它企业的共同配送提高设备利用率降低配送成本。供应商配送模式下，商品配送的正向物流可以同时实现商品退货的逆向物流，但其缺点在于小订单物流配送的费用往往较高。 自营配送模式是指连锁快递企业借助于自身的物质条件，结合各分店的商品配送量、经营规模以及网点布局等多种条件与环境，选择适当的地点出资建立一个或几个配送中心，由公司总部对配送中心进行经营管理，完成对各分店的全部配送业务', 0, 149265, '2016-09-12 09:26:05'),
