(1979, 4, 405, 1907, '直营:经营管理统一化，易于发挥整体优势 服务水平高 员工队伍稳定 信息化程度高', 0, 149201, '2016-09-12 09:26:27'),
(1980, 4, 405, 1907, '特许，特许经营模式有助于企业规模的快速发展，快递公司应该在节约资金的基础上进一步扩大自己的规模，从而扩大市场占有率，提升自身的竞争力', 0, 149176, '2016-09-12 09:26:32'),
