(1997, 4, 405, 1907, '利用公路货运车辆空驶率高这一巨大商机，通过物流连锁企业为回程车辆配载取得较高的配载服务收入，这是新的利润点，也是网络的驱动力。\n● 建立总部、加盟企业、货主共同受益的利益分配机制，使多方都有动力维护合作，共同建立紧密型战略合作伙伴关系。\n', 0, 149150, '2016-09-12 09:27:55'),
