(1999, 4, 405, 1907, '适合直营连锁，原因是直营连锁RC(Regular Chain)就是指总公司直接经营的连锁店\n，即由公司本部直接经营投资管理各个零售点的经营形态，此连锁型态并无加盟店的存在。总部采取纵深似的管理方式，直接下令掌管所有的零售点，零售点也毫无疑问地必须完全接受总部的指挥。直接连锁的主要任务在渠道经营，意思指透过经营渠道的拓展从消费者手中获取利润。因此直营连锁实际上是一种管理产业。', 0, 149203, '2016-09-12 09:28:02'),
