(2648, 34, 343, 0, '发现着火时应怎样处理？', 3436, 0, '2016-09-26 10:20:53'),
(2649, 34, 343, 2559, '发现着火不要惊慌，应立即用身边灭火器材进行扑救，同时发出信号，向消防队报警。', 0, 11245, '2016-09-26 10:25:27'),
(2650, 34, 343, 2559, '（1）使用身边灭火器扑救，必须与燃烧物质相适应，在外援到来之前有效地控制火势的蔓延；（2）正确处理生产操作，防止火势扩大，以防误操作造成损失增大；（3）正确报警，报警前牢记电话号码，拨通后，要讲清着火点、着火对象、注意听清消防队人问话', 0, 11255, '2016-09-26 10:25:47'),
(2651, 34, 343, 2559, '发现着火不要惊慌，立即用身边灭火器材进行扑救，同时发出信号，向消防队报警，遇紧急行动时要注意：1、使用身边灭火器扑救，必须与可燃物相适应，在外援到来之前有效地控制火势的蔓延；2、正确处理生产操作，防止火势扩大，以防误操作造成损失增大；3、正确报警，报警前牢记电话号码，拨通后，要讲清着火点，着火对象，注意听清楚消防队人的问话。', 0, 11251, '2016-09-26 10:25:54'),
(2652, 34, 343, 1119, '实践为主，理论为辅，发散思维', 0, 11270, '2016-09-26 10:26:00'),
(2653, 34, 343, 2648, '首先拨打119，发生呼叫，组织人员有序撤离现场，之后根据所学知识，明确着火的物质，采取相应的措施灭火。', 0, 11271, '2016-09-26 10:26:07'),
(2654, 34, 343, 2559, '首先找到着火源，用消防工具进行灭火，并及时报警！在第一时间疏散人群！', 0, 11273, '2016-09-26 10:26:42'),
(2655, 34, 343, 2559, '能跑的赶紧跑，火势可控就去灭火，不要惊慌！冷静处理！', 0, 11262, '2016-09-26 10:27:20'),
(2656, 34, 343, 2559, '跑', 0, 11264, '2016-09-26 10:27:45'),
(2657, 34, 343, 2559, '火势蔓延时，应用衣服遮掩口鼻，放低身体姿势，浅呼吸、快速、有序地向安全出口撤离。尽量避免大声呼喊，防止有毒烟雾进入呼吸道。', 0, 11243, '2016-09-26 10:28:51'),
(2658, 34, 343, 2559, '控制着火源，救火时应该用脸盆遮住脸，防止火源伤到自己，第一时间判断起火的原因。', 0, 11249, '2016-09-26 10:29:16'),
(2659, 34, 343, 2559, '一是掌握准确的报警方法，向消防队及时报警，报警愈早，损失愈小。同学们要牢记“119”火警电话。报警时一定要沉着、冷静，准确地讲清起火单位、所在地区、街道、门牌号码、起火部位、燃烧物质、火势大小、报警人姓名以及所使用电话的号码。报完警后，应派人在路口接应和引导消防车进入火场，及时扑救，减少损失。', 0, 11257, '2016-09-26 10:29:34'),
(2660, 34, 343, 2648, '火', 0, 11252, '2016-09-26 10:30:01'),
(2661, 34, 343, 2559, '1.根据着火情况，是否拨打119报警。\n2.立即逃生。\n3.根据实际情况，是否组织救火。\n，总之一切以实际情况出发。', 0, 11242, '2016-09-26 10:30:38'),
(2662, 34, 343, 2559, '报警早、损失小；边报警、边扑救；先控制、后灭火；先救人、后救物；防中毒、防窒息；听指挥、莫惊慌。', 0, 11265, '2016-09-26 10:30:47'),
(2663, 34, 343, 2559, '先看一下着火的东西是什么，普通的着火物可以用水灭火，电起火的话不能用水灭火，可以切断电源，然后用灭火器灭火，着火严重可以打119。人不能往楼上跑，应该顺着安全通道撤离。', 0, 11250, '2016-09-26 10:30:52'),
(2664, 34, 343, 2559, '打119跑', 0, 11247, '2016-09-26 10:30:55'),
(2665, 34, 343, 2559, '保持冷静，快速打电话给火警，看火势能控制是尽力控制，若火势太大无法控制，首先保证自己人身安全，快速离开火灾现场。', 0, 11272, '2016-09-26 10:31:43'),
(2666, 34, 343, 2648, '若火灾可控、及时告知他人、组织救火；若火灾不可控制、组织撤离并拨打119', 0, 11269, '2016-09-26 10:32:42'),
