(2684, 34, 343, 2559, '发现着火不要惊慌，应立即用身边灭火器材进行扑救，同时发出信号，向消防队报警，遇紧急行动时要注意：（1）使用身边灭火器扑救，必须与燃烧物质相适应，在外援到来之前有效地控制火势的蔓延；（2）正确处理生产操作，防止火势扩大，以防误操作造成损失增大；（3）正确报警，报警前牢记电话号码，拨通后，要讲清着火点、着火对象、注意听清消防队人问话。', 0, 11282, '2016-09-26 14:44:37'),
