(2694, 34, 343, 2559, '　发现初起火灾，应及时报警并利用楼内的消防器材及时扑灭。要保持头脑清醒，千万不要惊慌失措、盲目乱跑。火势蔓延时，应用衣服遮掩口鼻，放低身体姿势，浅呼吸、快速、有序地向安全出口撤离。尽量避免大声呼喊，防止有毒烟雾进入呼吸道。离开房间后，应关紧房门，将火焰和浓烟控制在一定的空间内。', 0, 11284, '2016-09-26 15:16:05'),
