(2758, 4, 521, 0, '大家认为大学生职业生涯规划就业指导课程应该开设几个学期？为什么？必要性在哪里？', 118466, 0, '2016-10-07 09:51:18'),
(2759, 4, 521, 2758, '《大学生职业发展与就业指导〉课程在我们学校属于公共必修课程，这也是与国务院，教育部的要求相一致的，《大学生职业发展与就业指导〉课程共开设三个学期，即：大一第一学期，主要讲授大学生学习职业生涯意识的培养，大二第二学期，主要讲授国家就业形势就当前就业政策的知识了解，大三第一学期，主要讲授求职前的准备！也就是说，此门课程会伴随大家三年的大学生活，会帮助大家顺利的度过三年有意义的青春时光。', 0, 118466, '2016-10-07 10:10:08'),
(2760, 4, 523, 0, '大学生就业指导课程共开设几个学期？大家觉得必要性在哪里？', 118466, 0, '2016-10-07 10:13:11'),
(2761, 4, 523, 2760, '大学生职业发展与就业指导一共有三个学期的课程，分别是大一第一学期，大二第二学期，大三第一学期。大一第一学期的课程主要侧重于职业生涯规划，帮助大家树立规划的意识，制定好三年的学业规划，全面提升自己的专业技能和综合素质。比如说，大家来到咱们学校的一个重要原因，就是听说咱们学校就业率还不低，就业质量还比较高，就业以后的收入还算可观，但是，高的就业率、就业质量和就业收入从哪里来？难道因为你是黄河水院的学生？绝对不是！那从哪里来？上完这个学期的课程你就知道了。大二第二学期的课程主要帮助大家了解一些就业形势和就业政策，掌握一些择业的方法和技巧。大三第一学期主要帮助大家掌握面试的技巧和就业的程序，以及如何迈好走向社会的第一步。', 0, 118466, '2016-10-07 10:14:00'),
