(2820, 4, 567, 2792, '　　缓冲区分析及其用途： 　　缓冲区分析是GIS的基本空间操作功能之一，是指在点、线、面实体的周围，自动建立的一定宽度的多边形。 　　例如，某地区有危险品仓库，要分析一旦仓库爆炸所涉及的范围，这就需要进行点缓冲区分析；而在对野生动物栖息地的评价中，动物的活动区域往往是在距它们生存所需的水源或栖息地一定距离的范围内，为此可用面缓冲区进行分析，等等。 　　', 0, 153801, '2016-10-14 15:09:19'),
