(2910, 4, 583, 2880, '百岁山的水萃取与大自然大山中，没有污染，很健康，时尚，无公害，工厂建设在距离原产地最近的地方，更加证明了水的纯粹性，瓶身也用了透明的！更加无污染！', 0, 149486, '2016-10-19 14:42:53'),
(2911, 4, 583, 2880, 'F指属性和功效即自己的产品的特点和属性', 0, 149479, '2016-10-19 14:42:59'),
(2912, 4, 583, 2880, '百岁山矿泉水在特定的地质环境作用下，水源经百余年深层循环及涌动，富含了偏硅酸、锂、锶、钙、钾等多种有益于人体健康的微量元素，其中的偏硅酸对人体主动脉硬化具有软化作用，对心脏病、高血压、动脉硬化、神经功能紊乱、胃病及胃溃疡等均有保健作用，并具有抗癌抗衰老的功能。', 0, 149528, '2016-10-19 14:43:02'),
(2913, 4, 583, 2880, '百岁山矿泉水是富含锶、钾、钠、钙、镁、锌、偏硅酸等多种对人体有益的矿物质成分;\n水中矿物质钙、镁离子，被医学界称为人体的保护元素，保持矿泉水自身功能，同时对人体生理功能 有非常大的影响，还能能够抵抗其他有害元素的侵袭。', 0, 149553, '2016-10-19 14:43:04'),
(2914, 4, 583, 2880, 'F：天然矿泉水水，世上少见的优质矿泉水，水质天然纯净无污染。 A:富含酸、锂、锶、钙、钾等多种微量元素 B:有益于身体健康。', 0, 149501, '2016-10-19 14:43:07'),
