(3123, 66, 596, 0, '什么是盘左盘右', 490, 0, '2016-10-21 14:27:35'),
(3124, 66, 596, 3123, '左边竖直度盘是盘左   右边竖直度盘为盘右', 0, 7068, '2016-10-21 14:29:08'),
(3125, 66, 596, 3123, '观测时当竖盘在观测人员的左侧时称为盘左，反之称为盘右。', 0, 7060, '2016-10-21 14:29:12'),
(3126, 66, 596, 3123, '竖直度盘在望远镜左边，是盘左，竖直度盘在望远镜右边，是盘右。', 0, 7052, '2016-10-21 14:29:52'),
(3127, 66, 596, 3123, '拨盘手轮的左边和右边', 0, 7053, '2016-10-21 14:30:17'),
(3128, 66, 596, 3123, '左边数值度盘就是盘左，右边数值度盘就是盘右。', 0, 7071, '2016-10-21 14:30:24'),
(3129, 66, 596, 3123, '竖直度盘在左为盘左，竖直度盘在右为盘右', 0, 7040, '2016-10-21 14:30:31'),
(3130, 66, 596, 3123, '角度度盘在观察镜的左侧角度度盘在观察镜的右侧', 0, 7061, '2016-10-21 14:30:40'),
(3131, 66, 596, 3123, '盘左就是角度度盘在观察镜的左边，盘右就是角度度盘在观察镜的右边', 0, 7045, '2016-10-21 14:30:44'),
(3132, 66, 596, 3123, '左边的竖直度盘叫盘左，反之，右边的叫盘右。', 0, 7064, '2016-10-21 14:30:45'),
(3133, 66, 596, 3123, '目镜朝向自己，竖直度盘为盘左，顺时针旋转180度，竖直度盘为盘右', 0, 7077, '2016-10-21 14:30:54'),
(3134, 66, 596, 3123, '竖直度盘在望远镜左边叫盘左，\n竖直度盘在望远镜右边叫盘右。', 0, 7049, '2016-10-21 14:30:54'),
(3135, 66, 596, 3123, '目镜朝向自己，竖直度盘为盘左，顺时针旋转180度，竖直度盘为盘右', 0, 7077, '2016-10-21 14:30:59'),
(3136, 66, 596, 3123, '转动竖直度盘在望远镜左边叫盘左，相反，为盘右', 0, 7041, '2016-10-21 14:31:00'),
(3137, 66, 596, 3123, '竖直度盘位望远镜左侧，是盘左。反之，为盘右', 0, 7069, '2016-10-21 14:31:04'),
(3138, 66, 596, 3123, '竖直度盘在望远镜的左侧，则是盘左再将望远镜顺时针旋转180度竖直度盘位于望远镜的右侧则是盘右', 0, 7031, '2016-10-21 14:31:07'),
(3139, 66, 596, 3123, '盘左边是盘左，顺时针转动后，盘右边是盘右，以竖直度盘为参考。', 0, 7076, '2016-10-21 14:31:08'),
(3140, 66, 596, 3123, '竖直度盘在望远镜上左边叫盘左，右边叫盘右', 0, 7039, '2016-10-21 14:31:14'),
(3141, 66, 596, 3123, '观测者正对着望远镜目镜，竖盘位于望远镜左侧时，称盘左。竖盘位于望远镜右侧时，称右盘。', 0, 7066, '2016-10-21 14:31:15'),
(3142, 66, 596, 3123, '观测时当竖盘在观测人员的左侧时称为盘左，反之称为盘右。', 0, 7057, '2016-10-21 14:31:21'),
(3143, 66, 596, 3123, '竖直度盘在望远镜左侧，叫盘左，将望远镜旋转180度，将仪器旋转180度，竖直度盘在望远镜右侧，叫盘右', 0, 7054, '2016-10-21 14:31:22'),
