(3150, 66, 596, 3123, '全站仪盘左和盘右根据的是竖盘相对观测人员所处的位置而言的，观测时当竖盘在观测人员的左侧时称为盘左，反之称为盘右。', 0, 7051, '2016-10-21 14:31:58'),
(3151, 66, 596, 3123, '当望远镜正视是，竖直度盘在左为盘左，当望远镜反视时，竖直度盘在右为盘右。', 0, 7058, '2016-10-21 14:32:02'),
