(3242, 4, 622, 3229, '确切地说，可视化是一个过程：它将数据、信息和知识转化为一种形象化的视觉表达形式。充分利用了人们对可视模式快速识别的自然能力，以形象化的姿态接受大众的解读', 0, 153777, '2016-10-28 14:37:46'),
