(3244, 4, 622, 3229, '可视化(Visualization)，是利用计算机图形学和图像处理技术，将数据转换成图形或图像在屏幕上显示出来，并进行交互处理的理论、方法和技术。', 0, 153770, '2016-10-28 14:37:56'),
