(3249, 4, 622, 3229, '地理信息可视化是CIS技术与现代计算机图形、图像处理显示技术、数字建模技术\n结合共同发展的结果。地理信息的空间数据、数据处理与分析成果可通过不同显示方法\n可视化表达的形式表达出来。', 0, 153782, '2016-10-28 14:38:18'),
(3250, 4, 622, 3229, '是利用计算机图形学和图像处理技术，将数据转换成图形或图像在屏幕上显示出来，并进行交互处理的理论、方法和技术。', 0, 153768, '2016-10-28 14:38:21'),
(3251, 4, 622, 3229, '是利用计算机图形学和图像处理技术，将数据转换成图形或图像在屏幕上显示出来，并进行交互处理的理论、方法和技术。它涉及到计算机图形学、图像处理、计算机视觉、计算机辅助设计等多个领域，成为研究数据表示、数据处理、决策分析等一系列问题的综合技术。', 0, 153776, '2016-10-28 14:38:29'),
