(3261, 4, 622, 3229, '计算机图形，图像处理显示技术，数字建模技术相结合共同发展的结果', 0, 153779, '2016-10-28 14:39:17'),
(3262, 4, 622, 3252, '地理信息可视化是将地理信息数据转换为人们容易理解的图形图像方式。随着计算机、图形、图像技术的飞速发展，人们现在已经可以用丰富的色彩、动画技术、三维立体显示及仿真等手段，形象地表现各种地形特征。', 0, 153770, '2016-10-28 14:39:23'),
(3263, 4, 622, 3252, '地理信息可视化（ Geographic Information Visualization）。地理信息可视化是将地理信息数据转换为人们容易理解的图形图像方式。随着计算机、图形、图像技术的飞速发展，人们现在已经可以用丰富的色彩、动画技术、三维立体显示及仿真等手段，形象地表现各种地形特征', 0, 153829, '2016-10-28 14:39:26'),
(3264, 4, 622, 3252, '地理信息透明化', 0, 153780, '2016-10-28 14:39:27'),
(3265, 4, 622, 3252, '\n地理信息可视化是可视化发展的方向之一.通过对地理信息的概念和运动模型的分析,并从可视化的定义出发,总结了地理信息可视化的特点,同时提出了地理信息可视化研究的一个基本框架.最后针对地理信息系统中的可视化过程进行了描述.', 0, 153777, '2016-10-28 14:39:28'),
(3266, 4, 622, 3252, '将非直观的、抽象的、不可见的地理数据以图形图像的形式，直观形象地表达出来', 0, 153765, '2016-10-28 14:39:42'),
(3267, 4, 622, 3252, '将地理信息数据转换为人们容易理解的图形图像方式。', 0, 153817, '2016-10-28 14:39:51'),
(3268, 4, 622, 3252, '利用计算机图形的图形处理，将数据转化为图形', 0, 153754, '2016-10-28 14:39:52'),
(3269, 4, 622, 3252, '地理信息可视化是将地理信息数据转换为人们容易理解的图形图像方式', 0, 153805, '2016-10-28 14:39:56'),
(3270, 4, 622, 3252, '是将地理信息数据转换为人们容易理解的图形图像方式。', 0, 153776, '2016-10-28 14:39:57'),
(3271, 4, 622, 3252, '地理信息可视化是将地理信息数据转换为人们容易理解的图形图像方式。', 0, 153768, '2016-10-28 14:39:58'),
(3272, 4, 622, 3252, '借助计算机图形学和图像处理等技术，以图形图像信息的形式，直观形象地表达出来', 0, 153816, '2016-10-28 14:40:18'),
(3273, 4, 622, 3252, '将科学计算中产生的大量非直观的、抽象的或者不可见的数据，借助计算机图形学和图像处理等技术，以图形图像信息的形式，直观、形象地表达出来，并进行交互处理。', 0, 153756, '2016-10-28 14:40:20'),
(3274, 4, 622, 3252, '可视化的基本含义是将科学计算中产生的大量非直观的、抽象的或者不可见的数据，借助计算机图形学和图像处理等技术，以图形图像信息的形式，直观、形象地表达出来，并进行交互处理', 0, 153820, '2016-10-28 14:40:22'),
(3275, 4, 622, 3252, '信息可视化是CIS技术与现代计算机图形、图像处理显示技术、数字建模技\n结合我同发展的结果。地理信息的空间数据、数据处理与分析成果可通过个同显示方法\n可视化表达的形式表达出来。', 0, 153782, '2016-10-28 14:40:27'),
(3276, 4, 622, 3252, '地理信息可视化是将地理信息数据转换为人们容易理解的图形图像方式', 0, 153826, '2016-10-28 14:40:31'),
(3277, 4, 622, 3252, '将地理信息数据转换为人们容易理解的图形图像方式', 0, 153799, '2016-10-28 14:40:33'),
(3278, 4, 622, 3252, '以图形图像信息的形式 直观形象的表达出来', 0, 153804, '2016-10-28 14:41:37'),
(3279, 4, 622, 3252, '地理信息可视化是运用图形学、计算机图形学和图像处理技术，将地学信息输入、处理、查询、分析以及预测的结果和数据以图形符号、图标、文字、表格、视频等可视化形式显示并进行交互的理论、方法和技术。', 0, 153806, '2016-10-28 14:41:49'),
(3280, 4, 622, 3252, '把地理信息数据转化成可以看到的图像', 0, 153818, '2016-10-28 14:41:50'),
(3281, 4, 622, 3229, '数据转化为图像在屏幕上显示出来', 0, 153805, '2016-10-28 14:42:49'),
