(3289, 4, 637, 3288, '是在正确测量的前提下，所测得的数值和真实值之间的差异', 0, 153775, '2016-11-03 19:48:05'),
(3290, 4, 637, 3288, '测量值与实际值之间的差异。', 0, 153753, '2016-11-03 19:48:19'),
(3291, 4, 637, 3288, '所谓误差，是在正确测量的前提下，所测得的数值和真实值之间的差异，由于人的眼睛不能估得非常准，所以存在误差是不可避免的；而错误是由于不遵守测量仪器的使用规则，或读取、记录测量结果时粗心等原因造成的。所以，误差和错误是两个完全不同的概念。', 0, 153798, '2016-11-03 19:48:23'),
